(1, 'Nerf Elite 2.0 Ace SD-1 Blaster and 2 Official Nerf Elite Darts, Onboard 1-Dart Storage, Stealth-Sized, Easy to Use', 'nerf-elite-2-0-ace-sd-1-blaster-and-2-official-nerf-elite-darts-onboard-1-dart-storage-stealth-sized-easy-to-use', NULL, '<p>Bring along the compact Nerf Elite 2.0 Ace SD-1 blaster on all your missions and battles! </p>', '<p>Bring along the compact Nerf Elite 2.0 Ace SD-1 blaster on all your \r\nmissions and battles! Take advantage of this blaster\'s compact size when\r\n you\'ve got to move with stealth. Bring this compact blaster almost \r\nanywhere to launch into a stealth games and dart-blasting surprise \r\nattacks. It has onboard 1-dart so you can keep a second dart within \r\nreach for fast reloads. It comes with 2 Official Nerf Elite foam darts, \r\nso you can blast them indoors or outdoors. Get battling in 3 quick \r\nsteps: Load 1 dart into the front of the barrel, pull the priming \r\nhandle, and press the trigger to unleash the dart. Eyewear recommended \r\n(not included). No batteries required. Nerf and all related properties \r\nare trademarks of Hasbro.</p><p><br>NERF ELITE 2.0 ACE SD-1 DART BLASTER: Bring this pocket-size blaster to\r\n Nerf battles! You can take this compact blaster almost anywhere and \r\nlaunch into a stealth games and dart-blasting surprises<br>EASY TO \r\nLOAD, PRIME, AND FIRE: Easy to use! Load 1 dart into the front of the \r\nbarrel, pull back the priming handle, and press the trigger to unleash \r\nthe dart<br>ONBOARD DART STORAGE: Keep a second dart nearby to reload \r\nfast! The onboard storage on top of the blaster holds 1 dart so after \r\nyou launch 1 dart, you can reload the blaster to release another dart<br><br><br>Ages 8 and up <br>TO\r\n AVOID EYE INJURY: WARNING: Do not aim at eyes or face. Use of eyewear \r\nrecommended for players and people within range. Use only official Nerf \r\ndarts. Other darts may not meet safety standards. Do not modify darts or\r\n blaster. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 2 darts.</p>', 2.99, 0.24, 2.75, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Y8VoQuBqT1OkGJEZg2vk.png', 1, 1, NULL, '2024-04-18 04:06:52', '2024-04-18 04:25:50'),
(2, 'Nerf Elite 2.0 Slash Blaster, 2 Nerf Elite Darts, Pull To Prime Handle, Toy Foam Blaster For Outdoor Kids Games', 'nerf-elite-2-0-slash-blaster-2-nerf-elite-darts-pull-to-prime-handle-toy-foam-blaster-for-outdoor-kids-games', NULL, '<p>Gear up for battle with the Nerf Elite 2.0 Slash toy foam blaster! </p>', '<p>Gear up for battle with the Nerf Elite 2.0 Slash toy foam blaster! This \r\nsingle-fire blaster gives you the advantage in Nerf battles with its \r\ncompact size that\'s great for stealthy battling in kids outdoor games. \r\nIt includes 2 Official foam Nerf Elite darts that are fun to blast in \r\noutdoor games. This backyard toy dart blaster is easy to use and gets \r\nyou ready to go in 3 easy steps. Load 1 Nerf dart into the front of the \r\nbarrel, pull down the priming handle, and pull trigger to fire the dart.\r\n The Slash Nerf blaster toy for boys and girls is an awesome addition to\r\n Nerf blaster stockpiles with its small profile and Nerf Elite 2.0 \r\nperformance. It\'s great as a grab-and-go primary toy blaster and a \r\nquick-fire backup blaster in active outdoor play. Eyewear recommended \r\n(not included). No batteries required. Nerf and all related properties \r\nare trademarks of Hasbro.<br><br>GEAR UP FOR BATTLE WITH THE NERF ELITE\r\n 2.0 SLASH BLASTER: Gear up for dart blasting action in outdoor kids \r\ngames with this Nerf toy foam blaster that comes with 2 Nerf Elite darts<br>DESIGNED\r\n FOR STEALTH: The Slash blaster features a compact, take-along size \r\nthat\'s perfect for stealthy dart battling. Bring it to outdoor games to \r\ntake on opponents with a surprise blast<br>INCLUDES 2 NERF ELITE DARTS:\r\n Official Nerf Elite foam darts are great for outdoor play, and are \r\ntested and approved for performance and quality<br>PULL TO PRIME \r\nBLASTING: The Slash blaster is designed with a pull-down handle for easy\r\n priming. It\'s a great gift for boys and girls and a fun backyard toy \r\nblaster<br>LOAD, PRIME &amp; FIRE: You\'re ready for action in 3 easy \r\nsteps with this Nerf toy foam blaster. Load 1 dart into the barrel, pull\r\n down the priming handle, and pull the trigger<br><br>Ages 8 and up <br>TO\r\n AVOID EYE INJURY: WARNING: Do not aim at eyes or face. Use of eyewear \r\nrecommended for players and people within range. Use only official Nerf \r\ndarts. Other darts may not meet safety standards. Do not modify darts or\r\n blaster. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 2 darts.</p>', 3.19, 0.25, 2.94, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/C5OqZYaMO0SWaxBfgauV.png', 1, 1, NULL, '2024-04-18 04:13:07', '2024-04-18 04:13:07'),
(3, 'Nerf Official 10 Dart Elite Refill Pack for Nerf N-Strike Elite AccuStrike Zombie Strike Modulus Toy Blasters', 'nerf-official-10-dart-elite-refill-pack-for-nerf-n-strike-elite-accustrike-zombie-strike-modulus-toy-blasters', NULL, '<p>Blast with Official Nerf Darts -- the darts that hit the mark for performance and quality!</p>', '<p>Blast with Official Nerf Darts -- the darts that hit the mark for \r\nperformance and quality! Stock up on this refill pack of 10 Nerf Elite \r\ndarts and be ready to reload when Nerf competitions heat up. Nerf Elite \r\ndarts are designed for distance and blast up to 85 feet (26 meters).* \r\nThey are compatible with all Nerf toy blasters that use Elite darts, so \r\nplayers can use also them with Elite, AccuStrike Elite, Zombie Strike, \r\nand Modulus blasters. Nerf darts are constructed of foam with flexible, \r\nhollow tips, making them fun to blast indoors and outdoors. Load Nerf \r\nblasters with tested and approved Official Nerf Darts, the darts that \r\ndeliver performance and quality with every blast! Blasters each sold \r\nseparately. *Distance varies according to blaster. Nerf and all related \r\nproperties are trademarks of Hasbro.<br><br>INCLUDES 10 NERF ELITE DARTS: This refill pack includes 10 Nerf Elite Darts designed for distance<br>OFFICIAL\r\n NERF DARTS: Official Nerf Darts are tested and approved for performance\r\n and quality and constructed of foam with flexible, hollow tips<br>COMPATIBILITY:\r\n Compatible with all official Nerf blasters that use Elite darts:  \r\nincluding Elite, AccuStrike Elite, Zombie Strike, and Modulus toy \r\nblasters<br>ELITE DARTS BLAST UP TO 85 FEET*: Official Nerf Elite darts\r\n blast up to 85 feet (26 meters). *Distance varies according to blaster.<br><br>Ages 8 and up <br>CAUTION: Do not aim at eyes or face. TO AVOID INJURY: Do not modify darts. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: 10 darts.</p>', 4.19, 0.33, 3.86, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/jGiIa04rGavVB0ZKBAAj.png', 1, 1, NULL, '2024-04-18 04:15:12', '2024-04-18 04:15:12'),
(4, 'Nerf Elite Junior Racer Easy Play Dart Blaster with 4 Nerf Elite Darts, Nerf Blaster Outdoor Toys', 'nerf-elite-junior-racer-easy-play-dart-blaster-with-4-nerf-elite-darts-nerf-blaster-outdoor-toys', NULL, '<p>Nerf Elite Junior Easy Play toy foam blasters are designed for boys and \r\ngirls who are blasting into Nerf battles for the first time.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Nerf\r\n Elite Junior Easy Play toy foam blasters are designed for boys and \r\ngirls who are blasting into Nerf battles for the first time. Special \r\nfeatures make them easy to play with, so kids will be playing exciting \r\nNerf games in no time. They can launch into high-energy dart-blasting \r\nfun and experience the thrill of doing it all by themselves. These Nerf \r\nblasters are easy to hold, sized to fit comfortably in small hands and \r\nlightweight for easy carrying. The front-loading design makes inserting \r\ndarts a simple step. Blasting is easy, with handles that have the lowest\r\n pull force of any Nerf dart blasters. All these features let kids get \r\ninto lots of fast-moving action, and they can show off their blasting \r\nskills as they do each step on their own! The Easy Play Nerf Elite \r\nJunior Racer toy blaster has 2-dart capacity and includes 4 Nerf Elite \r\ndarts. Eyewear recommended (not included). Blasters each sold \r\nseparately, subject to availability. Nerf and all related properties are\r\n trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">Easy\r\n Play BLASTER: The Nerf Elite Junior Racer dart blaster is made for 6 \r\nyear old boys and girls, with an Easy Play design so kids can enjoy \r\nexciting Nerf dart blasting play all on their own<br>EASY TO HOLD: The \r\nNerf blaster is sized to fit comfortably in small hands and has a \r\nlightweight design that\'s easy for children to hold and carry<br>EASY \r\nTO LOAD &amp; BLAST: The blaster handle has the lowest pull force of any\r\n Nerf dart blasters, so it\'s easy for kids to pull back by themselves. \r\nThe Nerf darts insert easily into the front of the blaster<br>INCLUDES 4\r\n NERF ELITE DARTS FOR FUN BLASTING PLAY: The flexible foam darts are \r\nperfect for indoor play and backyard games. The Nerf Elite Junior Racer \r\nblaster fires 2 darts in a row<br>ACTIVE PLAY: Nerf Junior dart \r\nblasters are great gifts for 6 year old boys and girls and up, and \r\nencourage physical and social play as kids enjoy fun dart blasting games<br><br>Ages 6 and up <br>TO\r\n AVOID EYE INJURY: WARNING: Do not aim at eyes or face. Use of eyewear \r\nrecommended for players and people within range. Use only official Nerf \r\ndarts. Other darts may not meet safety standards. Do not modify darts or\r\n blaster.<br>Includes: blaster and 4 darts.</div><p></p>', 4.99, 0.40, 4.59, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/HAX3XbpHDYDZF4FwUWbQ.png', 1, 1, NULL, '2024-04-18 04:31:04', '2024-04-18 04:31:04'),
(5, 'Nerf Better Than Balloons Brand Water Toys, 36 Pods, Easy 1 Piece Clean Up, Ages 3+', 'nerf-better-than-balloons-brand-water-toys-36-pods-easy-1-piece-clean-up-ages-3-', NULL, '<p>Nerf Better Than Balloons brand is the water balloon alternative for a revolution in water play!</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Nerf\r\n Better Than Balloons brand is the water balloon alternative for a \r\nrevolution in water play! The colorful water pods are easy in every way,\r\n for frustration-free outdoor water fun. The innovative design makes \r\nthem fast and easy to fill and super easy to clean up. They\'re easy to \r\nhold and throw for soaking water games, bursting when they hit a target.\r\n Nerf Better Than Balloons pods stay in 1 piece when they burst, so when\r\n the play is over, picking them up goes quickly. The water pods come \r\nattached together on a sheet and are easy to remove. The design and \r\nmaterial make them sturdy and reliable for a big splash of fun water \r\nplay for everyone from kids to adults. They are not made with natural \r\nrubber latex.  Includes a total of 36 pods on 3 sheets and a reusable \r\nnozzle. Nerf and all related properties are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\" bis_skin_checked=\"1\">NERF\r\n BETTER THAN BALLOONS WATER PODS: They\'re the water balloon alternative!\r\n Burst into a revolution in water play with Nerf Better Than Balloons \r\npods! They\'re easy to fill, easy to use, and easy to clean up for fun, \r\nfrustration-free outdoor water games<br>FAST FILL: Nerf Better Than \r\nBalloons brand patented water pods feature an innovative design that \r\nmakes them quick and easy to fill, for less prep time and more playtime<br>EASY CLEAN UP: The water pods stay in 1 piece when they burst, making it fast and easy to clean up after play<br>THROW THEM FOR A BURST OF FUN: They burst when they hit a target, releasing water in a soaking splash<br>36 WATER PODS: This Nerf Better Than Balloons brand pack includes 36 colorful pods on 3 sheets<br>OUTSIDE\r\n WATER TOYS FOR KIDS: Nerf Better Than Balloons water toys make backyard\r\n water fun better than ever with these easy to use, fun to throw water \r\npods<br><br>Ages 3 and up <br>CAUTION: Do not aim at eyes or face. <br>WARNING: Small parts. Not for children under 3 years. <br>Adult assembly required.<br>Includes: 3 sheets (36 pods) and nozzle.</div><p></p>', 4.99, 0.40, 4.59, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/HQ2zhmBdFQVNiSIatVaU.png', 1, 1, NULL, '2024-04-18 04:36:11', '2024-04-18 04:36:11'),
(6, 'Nerf N-Strike NanoFire (blue)', 'nerf-n-strike-nanofire-blue-', NULL, '<p>This compact Nerf blaster lets kids take it almost anywhere to start \r\nblasting almost anytime! Load 1 dart into the barrel, pull down the \r\npriming handle, and pull the trigger to fire. Reload and fire again! </p>', '<p>This compact Nerf blaster lets kids take it almost anywhere to start \r\nblasting almost anytime! Load 1 dart into the barrel, pull down the \r\npriming handle, and pull the trigger to fire. Reload and fire again! \r\nStorage for 2 darts on the handle. Comes with 3 Elite darts. Available \r\nin 2 colors: blue and red (each sold separately).<br><br>\" Includes blaster and 3 darts.<br><br>\" Compact size<br>\" Single-shot blaster<br>\" Fires 1 dart at a time<br>\" Includes 3 Elite darts<br><br>\" Ages 8 and up<br>\"\r\n CAUTION: Do not aim at eyes or face. TO AVOID INJURY: Use only darts \r\ndesigned for this product. Do not modify darts or dart blaster.</p>', 5.29, 0.42, 4.87, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/sqiLR2eTcU2QNlHTUMAe.png', 1, 1, NULL, '2024-04-18 05:03:10', '2024-04-18 05:03:10'),
