(8, 'Nerf Hyper 25-Round Boost Refill -- Includes Pack of 25 Official Nerf Hyper Rounds -- For Use with Nerf Hyper Blasters', 'nerf-hyper-25-round-boost-refill----includes-pack-of-25-official-nerf-hyper-rounds----for-use-with-nerf-hyper-blasters', NULL, '<p>Make sure you have all the rounds you need for your Nerf Hyper battles!</p>', '<p>Make sure you have all the rounds you need for your Nerf Hyper battles! \r\nThis pack of 25 Official Nerf Hyper rounds will keep you in the game -- \r\nwhen the hopper gets low, pour in more rounds and get back to battling. \r\nNerf Hyper rounds feature an innovative design and material that \r\nmaximizes speed and capacity. Stock up with this 25-count round refill \r\nset so you can outlast and outblast the competition! Eyewear recommended\r\n (not included). Blasters each sold separately. Nerf Hyper rounds are \r\ncompatible only with Nerf Hyper blasters. Nerf and all related \r\nproperties are trademarks of Hasbro.<br><br>25 OFFICIAL NERF HYPER \r\nROUNDS: Pack includes 25 Nerf Hyper rounds to keep you stocked up and \r\nready to refill Nerf Hyper blasters so you can keep on competing in Nerf\r\n Hyper nonstop action<br>DESIGNED FOR SPEED AND CAPACITY: Nerf Hyper rounds maximize speed and capacity with their innovative design and material<br>FAST,\r\n EASY LOADING: They\'re easy to load into Nerf Hyper blaster hoppers -- \r\nopen the hopper lids and pour in the rounds -- and youre back to \r\nbattling fast! (Blasters each sold separately)<br><br>Ages 14 and up <br>TO\r\n AVOID EYE INJURY:WARNING: Do not aim at eyes or face. Use of eyewear \r\nrequired for players and people within range. Use only official Hyper \r\nrounds. Other rounds may not be safe. Do not modify rounds or blaster. \r\nAges 14 and up.<br>Includes: 25 rounds.</p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '