(9, 'Nerf Super Soaker Torrent Water Blaster, Pump to Fire a Flooding Blast of Water, Outdoor Water-Blasting Fun', 'nerf-super-soaker-torrent-water-blaster-pump-to-fire-a-flooding-blast-of-water-outdoor-water-blasting-fun', NULL, '<p>Soak your targets with a flooding blast of water from the Nerf Super Soaker Torrent water blaster! </p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Soak\r\n your targets with a flooding blast of water from the Nerf Super Soaker \r\nTorrent water blaster! Storm into backyard battles with this Super \r\nSoaker blaster that\'s easy to fill and fun to fire. Put the front of the\r\n blaster in water and pull the plunger handle back to fill the tank, \r\nthen push the handle forward to shower everyone with a flood of water. \r\nIt\'s a great size for fast-moving outdoor games and easy to use, so \r\nkids, teens, and adults can all join in the fun. The Torrent is great \r\nway for everyone to get outside, get active, and get soaked! Tank \r\ncapacity is 8 fluid ounces (236 milliliters). The Nerf Super Soaker \r\nbrand has been pouring on the fun since 1989 and continues to drench \r\neveryone with water-blasting mayhem! Head outdoors for extreme soakage \r\nwith Nerf Super Soaker blasters! Nerf Super Soaker and all related \r\nproperties are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">A\r\n FLOODING BLAST OF WATER: The Nerf Super Soaker Torrent water blaster \r\nunleashes a flooding blast of water from the blaster\'s barrel<br>PLUNGER-FIRING ACTION: Take aim at your targets and push the plunger handle forward to shower them with a soaking blast<br>EASY\r\n TO FILL: Easy to use! Immerse the front of the blaster in water, and \r\npull the plunger handle back to fill the tank. Tank holds up to 8 fluid \r\nounces (236 milliliters)<br><br><br>Ages 6 and up <br>CAUTION: Do not aim at eyes or face. <br>WARNING: Small parts may be generated.<br>Includes: 1 water blaster.</div><p></p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/MIj162GzfxozqGYfdDo4.png', 1, 1, NULL, '2024-04-18 05:10:14', '2024-04-18 05:10:14'),
(10, 'Super Soaker Piranha', 'super-soaker-piranha', NULL, '<p>Unleash stealthy soakage with the Super Soaker Piranha water blaster!</p>', '<p>Unleash stealthy soakage with the Super Soaker Piranha water blaster! It\r\n features a compact size thats easy to carry, so battlers can launch a \r\nsurprise attack almost anywhere. Fill the tank with up to 6 fluid ounces\r\n (177 milliliters) of water, take aim, and pull the trigger to start \r\nsoaking. The blue and white blaster is optimized for one-handed \r\nblasting, so battlers can stay mobile as they strike with stealth to \r\nsoak the competition!<br><br>Copyright Larami Ltd.<br>Nerf Super Soaker and all related properties are trademarks of Hasbro.<br><br>\"	Includes: 1 water blaster.<br><br>\"	Unleash stealthy soakage with the Super Soaker Piranha water blaster<br>\"	Fill the tank and pull the trigger to soak opponents<br>\"	Tank holds up to 6 fluid ounces (177 milliliters)<br><br>\"	Ages 6 and up<br>\"	CAUTION: Do not aim at eyes or face. TO AVOID INJURY: Use only clean tap water.<br>\"	WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.</p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/pFuERVmvhkeBawu3Z6E3.png', 1, 1, NULL, '2024-04-18 05:12:01', '2024-04-18 05:12:01'),
(11, 'Nerf Elite 2.0 Jolly Dash Dart Blaster and 2 Nerf Elite Darts, Pull Down Priming', 'nerf-elite-2-0-jolly-dash-dart-blaster-and-2-nerf-elite-darts-pull-down-priming', NULL, '<p>Blast into a winter wonderland of fun Nerf games with the Nerf Elite 2.0\r\n Jolly Dash blaster that features colorful holiday-themed decorations \r\nand a jolly design!</p>', '<p>Blast into a winter wonderland of fun Nerf games with the Nerf Elite 2.0\r\n Jolly Dash blaster that features colorful holiday-themed decorations \r\nand a jolly design! Celebrate the season with this easy-to-use dart \r\nblaster thats a great holiday gift for 8 year old boys and girls. It \r\ncomes with 2 Official Nerf Elite foam darts that are perfect for indoor \r\nand outdoor play. The blaster is topped with a fun scope design that \r\nadds to the blasters festive look. The compact size makes it easy to \r\ninclude with holiday gifts, to give kids a bright holiday surprise \r\nthats a real blast! Kids can dash into battling in 3 easy steps. Load 1\r\n dart into the front of the blaster, pull down the priming handle, and \r\npull the trigger. Eyewear recommended (not included). No batteries \r\nrequired. Nerf and all related properties are trademarks of Hasbro.<br><br>FUN\r\n WINTER HOLIDAY LOOK: The Nerf Elite 2.0 Jolly Dash blaster features a \r\ncolorful wintertime holiday look for fun dart blasting! A jolly gift for\r\n 8 year old boys and girls<br>LAUNCH INTO PULL DOWN PRIMING: The \r\nholidays are a blast with the Nerf Jolly Dash blaster! It has an easy \r\npull-down priming handle to get you dashing into fun Nerf games<br>2 \r\nNERF ELITE 2.0 FOAM DARTS: The blaster includes 2 Official Nerf Elite \r\n2.0 foam darts that are great for indoor and outdoor kids games<br>FUN SCOPE DESIGN: Look through the specially themed scope to take aim at targets for a winter wonderland of fun dart blasting<br>EASY\r\n LOAD AND FIRE: Start blasting in 3 easy steps! Front load a dart, pull \r\ndown the priming handle, and pull the trigger to fire<br><br>Ages 8 and up <br>TO\r\n AVOID EYE INJURY: WARNING: Do not aim at eyes or face. Use of eyewear \r\nrecommended for players and people within range. Use only official Nerf \r\ndarts. Other darts may not meet safety standards. Do not modify darts or\r\n blaster. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 2 darts.</p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/eOOdvFmOmnm0Yw4fNNPk.png', 1, 1, NULL, '2024-04-18 05:14:57', '2024-04-18 05:14:57'),
(12, 'Nerf Elite 2.0 Egg Hunt Dart Blaster and 2 Nerf Elite Darts', 'nerf-elite-2-0-egg-hunt-dart-blaster-and-2-nerf-elite-darts', NULL, '<p>Spring into fun Nerf games with the Nerf 2.0 Egg Hunt blaster that \r\nfeatures bright colors, fun decorations, and a playful design!</p>', '<p>Spring into fun Nerf games with the Nerf 2.0 Egg Hunt blaster that \r\nfeatures bright colors, fun decorations, and a playful design! This \r\neasy-to-use dart blaster is a great spring holiday gift for 8 year old \r\nboys and girls. It comes with 2 Official Nerf Elite foam darts that are \r\nperfect for indoor and outdoor games. The blaster is topped with a fun \r\nscope design that adds to the springtime theme. The compact size makes \r\nit easy to include in holiday gift baskets for an awesome dart-blasting \r\nsurprise. Kids can hop into battling in 3 easy steps. Load 1 dart into \r\nthe front of the blaster, pull down the priming handle, and pull the \r\ntrigger. Eyewear recommended (not included). No batteries required. Nerf\r\n and all related properties are trademarks of Hasbro.<br><br>FUN \r\nSPRINGTIME LOOK: The Nerf Elite 2.0 Egg Hunt blaster features a bright, \r\ncolorful springtime look for fun dart blasting! A great spring holiday \r\ngift for 8 year old boys and girls<br>HOP INTO PULL DOWN PRIMING: The Egg Hunt blaster has an easy pull-down priming handle to get you blasting into fun Nerf games<br>2\r\n NERF ELITE 2.0 FOAM DARTS: The blaster includes 2 Official Nerf Elite \r\n2.0 foam darts that are great for indoor and outdoor Nerf battles<br>FUN\r\n SCOPE DESIGN: The blaster is all ears when it comes to aiming! Look \r\nthrough the specially themed scope to take aim at targets<br>EASY LOAD \r\nAND FIRE: Start blasting in 3 easy steps! Front load a dart, pull down \r\nthe priming handle, and pull the trigger to spring into fun Nerf play<br><br>Ages 8 and up <br>TO\r\n AVOID EYE INJURY: WARNING: Do not aim at eyes or face. Use of eyewear \r\nrecommended for players and people within range. Use only official Nerf \r\ndarts. Other darts may not meet safety standards. Do not modify darts or\r\n blaster. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 2 darts.</p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/VyD1sZCkTkFwOx17Ky0j.png', 1, 1, NULL, '2024-04-18 05:17:09', '2024-04-18 05:17:09'),
(13, 'Nerf Super Soaker Hydro Balls 3-Pack, Reusable Water-Filled Balls', 'nerf-super-soaker-hydro-balls-3-pack-reusable-water-filled-balls', NULL, '<p>Nerf Super Soaker Hydro Balls are reusable water-filled balls that burst on impact to splatter water everywhere! </p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Nerf\r\n Super Soaker Hydro Balls are reusable water-filled balls that burst on \r\nimpact to splatter water everywhere! They\'re fast and easy to refill to \r\nkeep the water-drenching fun going in outdoor Nerf Super Soaker games. \r\nThe balls are made with a soft, flexible material. This set includes 3 \r\ncolorful Hydro Balls toys that separate into 2 interchangeable halves, \r\nso it\'s a cinch to put them back together for quick refilling. And \r\nfilling them up is easy! Attach the halves, dunk the balls in water, \r\nsqueeze them, and you\'re ready to go. And after throwing them, cleanup \r\nis quick, just pick up the halves and refill. They\'re great outdoor \r\nwater toys for 6 year old boys and girls, and lots of fun for everyone. \r\nThe Nerf Super Soaker brand has been pouring on the fun since 1989 and \r\ncontinues to drench kids, teens, and adults with lots of water-blasting \r\nmayhem! Nerf and all related properties are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">NERF\r\n SUPER SOAKER HYDRO BALLS: Reusable water-filled balls burst on impact! \r\nFill them with water and they burst apart when they connect with a \r\ntarget, splattering water everywhere<br>QUICK AND EASY TO FILL AND \r\nREFILL: The balls have 2 interchangeable halves. Attach 2 halves, dunk \r\nthe ball in water, squeeze it to add the water, and you\'re ready to go<br>INCLUDES\r\n 3 NERF HYDRO BALLS: This set comes with 3 balls. The balls separate \r\ninto 2 halves, and the halves are interchangeable, so it\'s easy to keep \r\nrefilling them as you play<br>SOFT MATERIAL: Nerf Hydro balls are made with soft, flexible material for lots of blasting fun<br>EASY\r\n CLEANUP: Play more, clean up less with reusable Nerf Super Soaker Hydro\r\n Ball toys! After the balls burst apart, you simply pick the halves and \r\nrefill them<br><br>Ages 6 and up <br>CAUTION: Do not aim at eyes or face. <br>WARNING: Small parts may be generated.<br>Includes: 3 balls.</div><p></p>', 5.99, 0.48, 5.51, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/BCZfP8HXHof3ttSSwRx7.png', 1, 1, NULL, '2024-04-18 05:21:29', '2024-04-18 05:21:29'),
(14, 'Nerf Sports Turbo Jr Football', 'nerf-sports-turbo-jr-football', NULL, '<p>Get into the game with the Nerf Sports Turbo Jr. football!</p>', '<p>Get into the game with the Nerf Sports Turbo Jr. football! This classic \r\nfootball is made of soft foam so kids can bring it with them to play \r\nalmost anywhere, anytime. Practice throws and passes and grab some \r\nfriends for a game with the Nerf Sports Turbo Jr. football! Nerf and all\r\n related properties are trademarks of Hasbro.<br><br>Foam football<br>Durable for tough play<br>Play anytime and anywhere<br><br>Ages 4 and up.<br>Includes 1 football.</p>', 6.29, 0.50, 5.79, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/OcFMM3r2M5pT88mVN9Bh.png', 1, 1, NULL, '2024-04-18 05:23:17', '2024-04-18 05:23:17'),
(15, 'Nerf Super Soaker DinoSquad Raptor-Surge Water Blaster, Trigger-Fire Soakage For Outdoor Summer Water Games', 'nerf-super-soaker-dinosquad-raptor-surge-water-blaster-trigger-fire-soakage-for-outdoor-summer-water-games', NULL, '<p>Team up with legendary dinosaurs as a member of the elite Dinosquad! \r\nHarness the extraordinary force of the greatest dinosaurs of all and \r\nblast into amazing adventures!</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Team\r\n up with legendary dinosaurs as a member of the elite Dinosquad! Harness\r\n the extraordinary force of the greatest dinosaurs of all and blast into\r\n amazing adventures! Send a dinotastic blast of water at your targets \r\nwith the DinoSquad Raptor-Surge water blaster! This Nerf Super Soaker \r\nwater blaster is inspired by a Velociraptor dinosaur\'s features for wild\r\n water-drenching adventures. Take aim and blast water from its mouth to \r\nsoak your targets! It\'s great for outdoor games, backyard battles, and \r\nall kinds of summertime fun. Great for kids, teens, and adults, and \r\nideal for dino-fans everywhere. Easy to fill and easy to fire: Open the \r\ncap, fill the tank with water, and close the cap, then pull the trigger \r\nto unleash a soaking stream of water! Nerf Super Soaker and all related \r\nproperties are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">NERF\r\n DINOSQUAD RAPTOR-SURGE WATER BLASTER: Unleash a stream of water from \r\nthe dinosaur\'s mouth! Head outside and take aim at your targets to pour \r\non water-blasting dinosaur action<br>AWESOME DINOSAUR DESIGN: This Nerf\r\n Super Soaker DinoSquad water blaster captures the look of a \r\nVelociraptor dinosaur for wild outdoor games and summer soakage fun<br>EASY\r\n TO FILL, EASY TO FIRE: Open the cap and fill the tank with water, close\r\n the cap, and pull the trigger to send out a soaking blast of water<br><br><br>Ages 6 and up <br>CAUTION: Do not aim at eyes or face. <br>WARNING: CHOKING HAZARD  Small parts may be generated. Not for children under 3 years.<br>Includes: 1 water blaster.</div><p></p>', 6.59, 0.53, 6.06, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/rPcEjARipiHOYbQx3MYh.png', 1, 1, NULL, '2024-04-18 05:27:25', '2024-04-18 05:27:25'),
(16, 'Nerf MicroShots Zombie Strike Crossfire Bow', 'nerf-microshots-zombie-strike-crossfire-bow', NULL, '<p>Blast into big fun with Nerf MicroShots series that features collectible, mini-sized versions of favorite Nerf blasters (each sold separately)!<br></p>', '<p>Blast into big fun with Nerf MicroShots series that features \r\ncollectible, mini-sized versions of favorite Nerf blasters (each sold \r\nseparately)! Defend against the zombies with the MicroShots Zombie \r\nStrike Crossfire bow, which fires 1 dart at a time and comes with 2 \r\nElite darts. <br><br>\" Includes blaster and 2 darts.<br><br>\" Mini version of a favorite Nerf blaster<br>\" Part of the collectible MicroShots series<br>\" Fires 1 dart at a time<br>\" Includes 2 Zombie Strike darts<br><br>\" Ages 8 and up<br>\"\r\n CAUTION: Do not aim at eyes or face. TO AVOID INJURY: Use only darts \r\ndesigned for this product. Do not modify darts or dart blaster.<br>\" WARNING: CHOKING HAZARD  Small parts may be generated. Not for children under 3 years.</p>', 7.99, 0.64, 7.35, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/KMD0zHUN3tUu0DFA2DNs.png', 1, 1, NULL, '2024-04-18 05:30:16', '2024-04-18 05:30:16'),
(17, 'Nerf Alpha Strike Boa RC-6 Blaster with 6-Dart Rotating Drum -- Fire 6 Darts in a Row -- Includes 6 Nerf Elite Darts', 'nerf-alpha-strike-boa-rc-6-blaster-with-6-dart-rotating-drum----fire-6-darts-in-a-row----includes-6-nerf-elite-darts', NULL, '<p>Fire 6 darts in a row from the Nerf Alpha Strike Boa RC-6 blaster that \r\nfeatures a rotating, 6-dart drum and includes 6 Official Nerf Elite foam\r\n darts that are great for indoor and outdoor games.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Fire\r\n 6 darts in a row from the Nerf Alpha Strike Boa RC-6 blaster that \r\nfeatures a rotating, 6-dart drum and includes 6 Official Nerf Elite foam\r\n darts that are great for indoor and outdoor games. You\'re ready for \r\nNerf dart-blasting fun fast as you load 6 darts into the drum, pull the \r\npriming handle, and press the trigger to fire 1 dart. Start blasting \r\nwith Alpha Strike blasters from Nerf, the number one blaster brand*! If \r\nyoure new to the Nerf brand, Alpha Strike blasters are an awesome way \r\nto get into adrenaline-pumping Nerf battles and experience the power and\r\n performance of the Nerf brand. Theyre easy to use so first-time \r\nbattlers can begin blasting fast. If youre already a Nerf fan, these \r\nblasters are great additions to Nerf collections! Eyewear recommended \r\n(not included). No batteries required. *Source: NPD POS Full Year 2019 \r\nBlasters/Shooters &amp; Accessories, G11 (US, AUS, CA, FR, GM, MX, BR \r\nRS, SP, UK, IT) Nerf and all related properties are trademarks of \r\nHasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">BOA\r\n RC-6 WITH 6-DART ROTATING DRUM: Fire 6 darts in a row from the Nerf \r\nAlpha Strike Boa RC-6 blaster that features a rotating 6-dart drum<br>INCLUDES\r\n 6 OFFICIAL NERF ELITE DARTS: Includes 6 Official Nerf Elite foam darts \r\nthat great for indoor and outdoor play and are tested and approved for \r\nperformance and quality<br>6-DART TARGET BLASTING: Load 6 darts into \r\nthe blaster, then pull the handle to prime the blaster and press the \r\ntrigger to fire (no batteries required)<br>START BLASTING WITH NERF \r\nALPHA STRIKE BLASTERS: Alpha Strike blasters are a great way to start \r\nexperiencing the power, performance, and excitement of Nerf, the number \r\none blaster brand*<br><br>Ages 8 and up <br>TO AVOID EYE INJURY: \r\nWARNING: Do not aim at eyes or face. Use of eyewear recommended for \r\nplayers and people within range. Use only official Nerf darts. Other \r\ndarts may not meet safety standards. Do not modify darts or blaster. <br>WARNING: CHOKING HAZARD  Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 6 darts.</div><p></p>', 7.99, 0.64, 7.35, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/lsHDcWET6clxPCL0HhMC.png', 1, 1, NULL, '2024-04-18 05:33:02', '2024-04-18 05:33:02'),
(18, 'Nerf Pro Gelfire Ignitor Blaster, 1,000 Gelfire Rounds, 60 Round Capacity, T-Pull Priming, Eyewear', 'nerf-pro-gelfire-ignitor-blaster-1-000-gelfire-rounds-60-round-capacity-t-pull-priming-eyewear', NULL, '<p>Burst into battle with Nerf Pro Gelfire blasters featuring hydrated rounds that burst on impact!</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Burst\r\n into battle with Nerf Pro Gelfire blasters featuring hydrated rounds \r\nthat burst on impact! The blasters deliver high-performance blasting to \r\nignite your competitive advantage. Nerf Pro Gelfire rounds come \r\ndehydrated in the box, giving you a huge amount of rounds for multiple \r\nrefills. Add water to hydrate the rounds for 3 to 4 hours to prepare \r\nthem for use. The hydrated gel rounds fire from the blaster at a high \r\nvelocity and burst when they hit a target. No need to pick up rounds! \r\nThe Nerf Pro Gelfire Ignitor blaster packs a lot of power in a compact \r\nsize, firing a round at a velocity of up to 150 FPS. Its the perfect \r\nsidekick blaster to take along so youre always ready for action. The \r\nblaster includes 1,000 dehydrated Nerf Pro Gelfire soft super absorbent \r\npolymer projectiles, and has up to 60-round capacity, trigger lock, and \r\nprotective eyewear. Outdoor use recommended. For ages 14 and up.\r\n\r\n\r\nNERF and HASBRO and all related trademarks and logos are trademarks of \r\nHasbro, Inc.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">\r\n	BURST INTO BATTLE WITH NERF PRO GELFIRE BLASTERS: The blasters fire \r\nhydrated rounds that burst on impact and deliver high-performance \r\nblasting to ignite your competitive advantage. Ages 14 and up<br>	NERF \r\nPRO GELFIRE IGNITOR BLASTER: This single fire blaster packs plenty of \r\npower in its compact size, making it a great sidekick in battle<br>	\r\nINCLUDES 1,000 NERF PRO DEHYDRATED GELFIRE ROUNDS: Add water to hydrate \r\nthe soft super absorbent polymer projectiles. No pick-up needed<br>	150 FPS: Unleash 1 round at time from this single-fire blaster at a velocity of 150 feet per second* <br>	60-ROUND CAPACITY: The Ignitor blaster holds up to 60 hydrated Nerf Pro Gelfire rounds <br>\r\n	NERF PRO GELFIRE BLASTERS ARE GREAT GIFTS FOR TEENS: They deliver \r\nhigh-performance blasting to ignite your competitive advantage! Each \r\nsold separately, subject to availability<br><br>	Includes: blaster, 2x 500 round packets, protective eyewear, and instructions.<br>	Ages 14 and up<br>\r\n	TO AVOID EYE INJURY: WARNING: Do not aim at eyes or face. Use of \r\neyewear always required for players and people within range. Use only \r\nofficial NERF GelFire Rounds. Use only clean tap water to hydrate \r\nrounds. Do not freeze or modify rounds. Do not modify blaster. Impact \r\nfrom rounds may cause temporary marks on skin. Ages 14 and up. This is \r\nnot a toy. Read instructions before use for important safety \r\ninformation.<br>	Do not eat. Keep away from pets.<br>	Rounds may stain.</div><p></p>', 9.99, 0.80, 9.19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/hgfW8oPUotUqtAqsvr2m.png', 1, 1, NULL, '2024-04-18 05:37:24', '2024-04-18 05:37:24'),
(19, 'Nerf N-Strike Elite Scout MKII', 'nerf-n-strike-elite-scout-mkii', NULL, '<p>Scout out the competition and strike fast with the Nerf N-Strike Elite Scout MKII blaster!</p>', '<p>Scout out the competition and strike fast with the Nerf N-Strike Elite \r\nScout MKII blaster! The rotating barrel holds 4 Nerf Elite darts and \r\nunleashes them 1 at a time. Load 4 darts into the front of the barrel, \r\npull back the handle to prime the blaster, and pull the trigger to fire 1\r\n dart. When the battle calls for mobility, grab the Scout MKII blaster \r\nto stay ready to act quickly as the action heats up. The Nef N-Strike \r\nElite Scout MKII blaster comes with 4 Nerf Elite darts designed for \r\ndistance. Nerf and all related properties are trademarks of Hasbro.<br><br>4-dart rotating drum<br>Includes 4 Nerf Elite darts designed for distance<br>Fires 4 darts in a row<br><br>Ages 8 and up <br>CAUTION:\r\n Do not aim at eyes or face. TO AVOID INJURY: Use only darts designed \r\nfor this product. Do not modify darts or dart blaster. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 4 darts.</p>', 10.00, 0.80, 9.20, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/XHM5N4qbgi6xqSF1fSpq.png', 1, 1, NULL, '2024-04-18 05:39:33', '2024-04-18 05:39:33'),
(20, 'Nerf Elite 2.0 Tetrad QS-4 Blaster, 4 Nerf Elite Darts, 4-Barrel Blasting, Tactical Rail for Customizing Capability', 'nerf-elite-2-0-tetrad-qs-4-blaster-4-nerf-elite-darts-4-barrel-blasting-tactical-rail-for-customizing-capability', NULL, '<p>Launch 4 darts in a row at your targets with the Nerf Elite 2.0 Tetrad \r\nQS-4 blaster that features 4 front-loading barrels. Load 1 dart into \r\neach barrel, pump the priming slide backward and forward, and pull the \r\ntrigger to unleash 1 dart.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Launch\r\n 4 darts in a row at your targets with the Nerf Elite 2.0 Tetrad QS-4 \r\nblaster that features 4 front-loading barrels. Load 1 dart into each \r\nbarrel, pump the priming slide backward and forward, and pull the \r\ntrigger to unleash 1 dart. Includes 4 Official Nerf Elite darts that are\r\n great for indoor and outdoor Nerf battles. The blaster has a tactical \r\nrail so you can customize it with Nerf accessories. Take advantage of \r\nthe stock to stabilize your aim as you challenge the competition in Nerf\r\n games. Gear up for battle with Nerf Elite 2.0 blasters that feature \r\nbuilt-in customizing capabilities so you can upgrade them and seize the \r\nadvantage in Nerf competitions. Build your stockpile of Elite 2.0 \r\nblasters to optimize your game strategy and bring tactical performance \r\nand flexibility to every mission and battle! Eyewear recommended (not \r\nincluded). Additional accessories sold separately, subject to \r\navailability. No batteries required. Nerf and all related properties are\r\n trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">4-BARREL BLASTING: The Tetrad QS-4 blaster has 4 front-loading barrels so you can fire 4 darts in a row at your targets<br>GREAT\r\n BLASTER TO START OR BUILD YOUR NERF STOCKPILE: Fun to blast, easy to \r\nuse! Tetrad QS-4 blaster is perfect for first-time Nerf battlers and is a\r\n great addition to your Nerf blaster collection<br>INCLUDES 4 NERF \r\nDARTS: Comes with 4 Official Nerf Elite foam darts that are tested and \r\napproved for performance and quality and are great for indoor and \r\noutdoor Nerf battles<br>EASY TO LOAD, PRIME, AND FIRE: Start blasting \r\nin no time with this easy-to-use blaster! Front-load a dart into each \r\nbarrel, pump the priming handle back and forth, and pull trigger to \r\nlaunch a dart<br>UPGRADE-READY BLASTER: The Nerf Elite 2.0 Tetrad QS-4 \r\nblaster has a tactical rail to customize the blaster for every battle or\r\n mission<br><br>Ages 8 and up <br>TO AVOID EYE INJURY: WARNING: Do not\r\n aim at eyes or face. Use of eyewear recommended for players and people \r\nwithin range. Use only official Nerf darts. Other darts may not meet \r\nsafety standards. Do not modify darts or blaster. <br>WARNING: CHOKING HAZARD - Small parts may be generated. Not for children under 3 years.<br>Includes: blaster and 4 darts.</div><p></p>', 10.00, 0.80, 9.20, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/mMVMfGtFMBjVZDikx3tb.png', 1, 1, NULL, '2024-04-18 05:43:36', '2024-04-18 05:43:36');
