(26, 'Marvel Spidey and His Amazing Friends Iron Man Action Figure Toy, Preschool Hero Figure with Accessory, Age 3 and Up', 'marvel-spidey-and-his-amazing-friends-iron-man-action-figure-toy-preschool-hero-figure-with-accessory-age-3-and-up', NULL, '<p>Its Spidey time! This Marvel Spidey and His Amazing Friends toy \r\nincludes an Iron Man action figure with a Repulsor Ray accessory for \r\naction-packed play.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Its\r\n Spidey time! This Marvel Spidey and His Amazing Friends toy includes an\r\n Iron Man action figure with a Repulsor Ray accessory for action-packed \r\nplay. The Repulsor Ray accessory clips onto the figures wrist, so \r\npreschoolers can imagine Iron Mans heroic missions. With this preschool\r\n Marvel action figure, epic action awaits! This Iron Man toy makes a \r\ngreat holiday or birthday gift for boys and girls ages 3 and up who love\r\n Super Hero adventures. Look for more Spidey and His Amazing Friends \r\naction figures, including Spidey, Miles Morales: Spider-Man, Black \r\nPanther, and Ghost-Spider. (Each sold separately. Subject to \r\navailability.) Copyright MARVEL. All trademarks and registered \r\ntrademarks are the property of their respective owners. Hasbro and all \r\nrelated terms are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">PRESCHOOL\r\n MARVEL ACTION FIGURE: Team up with this Iron Man action figure and \r\naccessory inspired by the Marvel Spidey and His Amazing Friends animated\r\n show<br>POSEABLE ACTION FIGURE: This 4-inch Iron Man figure features 5\r\n points of articulation so kids can pose their Super Hero action figure \r\nfor exciting adventures<br>REPULSOR RAY ACCESSORY: Inspire creative \r\nplay with this Marvel Spidey and His Amazing Friends Iron Man action \r\nfigure and Repulsor Ray accessory that clips to the figures wrist<br>BIG\r\n HERO FUN FOR SMALL SPIDEY FANS: Marvels Spidey And His Amazing Friends\r\n toys are sized right for small hands. This figure and accessory makes a\r\n great holiday or birthday gift for 3 year olds and up<br>LOTS TO \r\nCOLLECT: Look for additional Spidey and His Amazing Friends action \r\nfigures, including Spidey, Miles Morales: Spider-Man, and Ghost-Spider. \r\n(Sold separately. Subject to availability.)<br><br>Ages 3 and up <br>Warning: Small parts may be generated. Not for children under 3 years.<br>Includes figure and accessory.</div><p></p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/lN2EUXscv6UnluDxiBWk.png', 1, 1, NULL, '2024-04-18 06:14:02', '2024-04-18 06:14:02'),
(27, 'Marvel Spidey and His Amazing Friends Hero Figure, 4-Inch Action Figure, Super Hero Toys', 'marvel-spidey-and-his-amazing-friends-hero-figure-4-inch-action-figure-super-hero-toys', NULL, '<p>It\'s Spidey Time! Marvel\'s Spidey and His Amazing Friends follows the adventures of Team Spidey and all their heroic friends.</p>', '<p>It\'s Spidey Time! Marvel\'s Spidey and His Amazing Friends follows the \r\nadventures of Team Spidey and all their heroic friends. Super Hero \r\nFigures are inspired by the popular preschool show and features a \r\n4-inch-scale posable action figure. Kids 3 and up can imagine their very\r\n own adventures with their favorite characters, or re-create favorite \r\nmoments from the show. Each surprise toy figure comes in a box with a \r\npeek-a-boo window. Collect all 7 characters! (Each sold separately. \r\nSubject to availability.) Copyright MARVEL. All trademarks and \r\nregistered trademarks are the property of their respective owners. \r\nHasbro and all related terms are trademarks of Hasbro.<br><br>7 SPIDEY \r\nTOYS TO COLLECT: Every box is a surprise! Kids can collect all 7 of \r\ntheir favorite Team Spidey heroes and baddies: Spidey, Ghost-Spider, \r\nMiles \"Spin\" Morales, Iron Man, Black Panther, Green Goblin, and \r\nElectro. (Each sold separately. Subject to availability.)<br>POSEABLE \r\nACTION FIGURE: Each 4-inch-scale hero figure features 5 points of \r\narticulation in the arms, head, and legs, so kids can pose characters \r\nfor action during pretend misisons and adventures!<br>BIG HERO FUN FOR SMALL SPIDEY FANS: Figures are sized appropriately for small hands with big imaginations!<br>INSPIRED\r\n BY THE HIT DISNEY JUNIOR SHOW: Kids ages 3 and up will love re-creating\r\n their favorite moments from the show, or imagining their very own \r\nadventures with Team Spidey<br>MORE FUN WITH TEAM SPIDEY: Look for more\r\n Marvel Spidey and His Amazing Friends toys, vehicles, and playsets for \r\neven more webtastic fun! (Each sold separately. Subject to \r\navailability.)<br>FUN GIFT FOR KIDS: This fun board game for families \r\nand kids makes an awesome gift for Teenage Mutant Ninja Turtles fans, \r\nMonopoly game fans, and gamers ages 8 and up<br>SUSTAINABLE PACKAGING: Ships in simple, recyclable packaging that\'s easy to open and frustration free<br><br>Ages 4 and up.<br>WARNING: Small parts may be generated. Not for children under 3 years.<br>Includes figure.</p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Rj8IO82cigJGSGGudStn.png', 1, 1, NULL, '2024-04-18 06:17:08', '2024-04-18 06:17:08'),
(28, 'Marvel Spidey and His Amazing Friends Green Goblin Hero Figure, 4-Inch Scale Action Figure And 1 Accessory, For Kids Ages 3 And Up', 'marvel-spidey-and-his-amazing-friends-green-goblin-hero-figure-4-inch-scale-action-figure-and-1-accessory-for-kids-ages-3-and-up', NULL, '<p>Green Goblin is a first-class mischief maker and playful prankster.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Green\r\n Goblin is a first-class mischief maker and playful prankster. When he\'s\r\n riding on his glider, Spidey and his friends had better watch out! It\'s\r\n Spidey Time! Marvel\'s Spidey and His Amazing Friends follows the \r\nadventures of the Super Hero Spidey and all his heroic friends! Spidey, \r\nGhost-Spider, and Miles Morales all have super spider-powers: \r\nspider-sense, super-strength, wall-crawling, and more! Each brings \r\nsomething unique to their crime-fighting adventures, making them even \r\nstronger when they\'re working together as the amazing Spider Team! But \r\neven the best team sometimes needs a helping hand that\'s when it\'s good\r\n to have allies like Ms. Marvel, Black Panther, and even Hulk! It\'s hard\r\n being a Super Hero, but it helps when you have such Amazing Friends! \r\nStopping bad guys and crawling wallsTeam Spidey does it all! Copyright \r\nMARVEL. All trademarks and registered trademarks are the property of \r\ntheir respective owners. Hasbro and all related terms are trademarks of \r\nHasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">ICONIC\r\n MARVEL CHARACTER INSPIRED BY THE ANIMATED SHOW: Web-out with an iconic \r\nMarvel character! Kids will love playing with this fan-favorite Green \r\nGoblin figure inspired by Spidey And His Amazing Friends, the preschool \r\nMarvel animated show on Disney Jr.<br>POSEABLE ACTION FIGURE: Each \r\n4-inch scale Spidey And His Amazing Friends Hero figure features 5 \r\npoints of articulation. Pose your hero for any exciting adventure<br>BIG\r\n HERO FUN FOR SMALL SPIDEY FANS: Marvel Spidey And His Amazing Friends \r\nfigures and vehicles are sized right for small hands. This toy makes a \r\ngreat birthday gift or holiday gift for kids<br>IMAGINE SENSATIONAL \r\nSPIDEY ADVENTURES WITH FIGURE &amp; ACCESSORY: Inspire bold, creative \r\nplay with this Marvel Spidey and His Amazing Friends Green Goblin figure\r\n with glider accessory that figure can fit on<br>COLLECT THEM ALL: \r\nLet\'s swing, Spidey Team! Look out for other Spidey and His Amazing \r\nFriends figures and collect them all, including: Spidey, Miles Morales, \r\nGreen Goblin, and Ghost-Spider<br><br>Ages 3 and up <br>Warning: Choking Hazard - Small parts may be generated. Not for children under 3 years.<br>Includes figure and accessory.</div><p></p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/t9sX3cSW09JYiEWGDImb.png', 1, 1, NULL, '2024-04-18 06:20:58', '2024-04-18 06:20:58'),
