SEABLE ACTION FIGURE: Each 4-inch \r\nscale Spidey And His Amazing Friends Hero figure features 5 points of \r\narticulation. Pose your hero for any exciting adventure<br>BIG HERO FUN\r\n FOR SMALL SPIDEY FANS: Marvel Spidey And His Amazing Friends figures \r\nand vehicles are sized right for small hands. This toy makes a great \r\nbirthday gift or holiday gift for kids<br>IMAGINE SENSATIONAL SPIDEY \r\nADVENTURES WITH FIGURE &amp; ACCESSORY: Inspire bold, creative play with\r\n this Marvel Spidey and His Amazing Friends Spidey figure and web \r\naccessory that clips on figure\'s wrist<br>COLLECT THEM ALL: Let\'s \r\nswing, Spidey Team! Look out for other Spidey and His Amazing Friends \r\nfigures and collect them all, including: Spidey, Miles Morales, Green \r\nGoblin, and Ghost-Spider<br><br>Ages 3 and up <br>Warning: Choking Hazard - Small parts may be generated. Not for children under 3 years.<br>Includes figure and accessory.</div><p></p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/fLdbZdaC2dHMn0YknIIQ.png', 1, 1, NULL, '2024-04-18 06:25:47', '2024-04-18 06:25:47'),
