ny exciting adventure<br>BIG HERO FUN FOR SMALL SPIDEY FANS: \r\nMarvels Spidey And His Amazing Friends figures are sized right for \r\nsmall hands. This toy makes a great birthday gift or holiday gift for \r\nkids ages 3 and up<br>IMAGINE SENSATIONAL ADVENTURES WITH FIGURE &amp; \r\nACCESSORY: Inspire bold, creative play with this Marvel Spidey and His \r\nAmazing Friends Black Panther figure and shield accessory that clips \r\nonto figure<br>COLLECT THEM ALL: Let\'s swing, Spidey Team! Look out for\r\n other Spidey and His Amazing Friends figures, including Spidey, Green \r\nGoblin, Hulk, and Ghost-Spider<br><br>Ages 3 and up <br>Warning: Choking Hazard - Small parts may be generated. Not for children under 3 years.<br>Includes figure and accessory.</div><p></p>', 5.59, 0.45, 5.14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Xd1ejN5waztrFacljku6.png', 1, 1, NULL, '2024-04-18 06:29:32', '2024-04-18 06:29:32'),
(31, 'Marvel Avengers Epic Hero Series Captain America 4\" Action Figure for Kids 4+', 'marvel-avengers-epic-hero-series-captain-america-4-action-figure-for-kids-4-', NULL, '<p>United to battle the foes no single hero could withstand, The Avengers \r\nare the most powerful Super Hero team in the world. Kids can play as the\r\n red, white, and blue suited Avenger, Captain America, with this \r\n4-inch-scale action figure to imagine hero versus villain battles.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">United\r\n to battle the foes no single hero could withstand, The Avengers are the\r\n most powerful Super Hero team in the world. Kids can play as the red, \r\nwhite, and blue suited Avenger, Captain America, with this 4-inch-scale \r\naction figure to imagine hero versus villain battles. Captain America \r\ntoy features multiple points of articulation and classic design and deco\r\n so toy figures can be posed for playtime or for display. An iconic \r\nshield accessory is also included for even more pretend action fun! \r\nMarvel action figures come in a package with a window that is great for \r\ngifting or collecting. Look for more Marvel Avengers toys and gifts to \r\nbuild your own super hero toy collection! (Each sold separately. Subject\r\n to availability.) Copyright MARVEL. All trademarks and registered \r\ntrademarks are the property of their respective owners. Hasbro and all \r\nrelated terms are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">PLAY\r\n AS CAPTAIN AMERICA: Sam Wilson carves out his own unique legacy as \r\nCaptain America, a member of Earths Mightiest Heroes, The Avengers<br>POSEABLE\r\n TOY FIGURE WITH ACCESSORY: This 4-inch Avengers action figure features \r\nmultiple points of articulation in the knees, elbows, shoulders, waist, \r\nand head for action-packed poseability for playtime or display. Figure \r\nalso includes a detachable, iconic shield accessory<br>ICONIC SUPER \r\nHERO DESIGN AND DECO: Cool action figure features classic Captain \r\nAmerica character design and deco that Marvel fans ages 4 and up know \r\nand love<br>ICONIC MARVEL AVENGERS PACKAGING: Each figure comes in a \r\npackage with a window that is great for gifting or displaying. Package \r\nfeatures Marvel Avengers logo and design<br>HASBRO\'S EXCLUSIVE EPIC \r\nHERO SERIES: Avengers action figures are part of the Epic Hero Series \r\n4-inch figures collection where toys are all compatible so kids can \r\ncreate their own heroic adventures inspired by the Marvel Universe! \r\n(Each sold separately. Subject to availability.)<br><br>Ages 4 and up.<br>WARNING: Small parts.<br>Includes figure and accessory.</div><p></p>', 9.99, 0.80, 9.19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Huwbl50yrqkpSZHKkKYM.png', 1, 1, NULL, '2024-04-18 13:10:00', '2024-04-18 13:10:00'),
(32, 'Marvel Avengers Epic Hero Series Black Panther 4\" Action Figure fo Kids 4+', 'marvel-avengers-epic-hero-series-black-panther-4-action-figure-fo-kids-4-', NULL, '<p>United to battle the foes no single hero could withstand, The Avengers \r\nare the most powerful Super Hero team in the world. Kids can play as the\r\n Wakandan King, Black Panther, with this 4-inch-scale action figure to \r\nimagine hero versus villain battles.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">United\r\n to battle the foes no single hero could withstand, The Avengers are the\r\n most powerful Super Hero team in the world. Kids can play as the \r\nWakandan King, Black Panther, with this 4-inch-scale action figure to \r\nimagine hero versus villain battles. Black Panther toy features multiple\r\n points of articulation and classic design and deco so toy figures can \r\nbe posed for playtime or for display. A Vibranium claw accessory is also\r\n included for even more pretend action fun! Marvel action figures come \r\nin a package with a window that is great for gifting or collecting. Look\r\n for more Marvel Avengers toys and gifts to build your own super hero \r\ntoy collection! (Each sold separately. Subject to availability.) \r\nCopyright MARVEL. All trademarks and registered trademarks are the \r\nproperty of their respective owners. Hasbro and all related terms are \r\ntrademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">PLAY\r\n AS BLACK PANTHER: King T\'Challa protects the nation of Wakanda and the \r\nworld as the Black Panther, a member of Earths Mightiest Heroes, The \r\nAvengers<br>POSEABLE TOY FIGURE WITH ACCESSORY: This 4-inch Avengers \r\naction figure features multiple points of articulation in the knees, \r\nelbows, shoulders, waist, and head for action-packed poseability for \r\nplaytime or display. Figure also includes a detachable Vibranium claw \r\naccessory<br>ICONIC SUPER HERO DESIGN AND DECO: Cool action figure \r\nfeatures classic Black Panther character design and deco that Marvel \r\nfans ages 4 and up know and love<br>ICONIC MARVEL AVENGERS PACKAGING: \r\nEach figure comes in a package with a window that is great for gifting \r\nor displaying. Package features Marvel Avengers logo and design<br>HASBRO\'S\r\n EXCLUSIVE EPIC HERO SERIES: Avengers action figures are part of the \r\nEpic Hero Series 4-inch figures collection where toys are all compatible\r\n so kids can create their own heroic adventures inspired by the Marvel \r\nUniverse! (Each sold separately. Subject to availability.)<br><br>Ages 4 and up.<br>WARNING: Small parts.<br>Includes figure.</div><p></p>', 9.99, 0.80, 9.19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Q1tsqnIL5AOkR5dBIJUM.png', 1, 1, NULL, '2024-04-18 13:13:04', '2024-04-18 13:13:04'),
(33, 'Marvel Avengers Epic Hero Series Thor 4\" Action Figure for Kids 4+', 'marvel-avengers-epic-hero-series-thor-4-action-figure-for-kids-4-', NULL, '<p>United to battle the foes no single hero could withstand, The Avengers \r\nare the most powerful Super Hero team in the world. Kids can play as the\r\n mighty hammer-wielding Avenger, Thor, with this 4-inch-scale action \r\nfigure to imagine hero versus villain battles.</p>', '<p>United to battle the foes no single hero could withstand, The Avengers \r\nare the most powerful Super Hero team in the world. Kids can play as the\r\n mighty hammer-wielding Avenger, Thor, with this 4-inch-scale action \r\nfigure to imagine hero versus villain battles. Thor toy features \r\nmultiple points of articulation and classic design and deco so toy \r\nfigures can be posed for playtime or for display. A Mjolnir hammer \r\naccessory is also included for even more pretend action fun! Marvel \r\naction figures come in a package with a window that is great for gifting\r\n or collecting. Look for more Marvel Avengers toys and gifts to build \r\nyour own super hero toy collection! (Each sold separately. Subject to \r\navailability.)<br>Copyright MARVEL. All trademarks and registered trademarks are the property of their respective owners.<br>Hasbro and all related terms are trademarks of Hasbro.<br><br>PLAY\r\n AS THOR: The hammer-wielding Thor uses his strength to protect Asgard \r\nand the realms beyond as a member of Earths Mightiest Heroes, The \r\nAvengers<br>POSEABLE TOY FIGURE WITH ACCESSORY: This 4-inch Avengers \r\naction figure features multiple points of articulation in the knees, \r\nelbows, shoulders, waist, and head for action-packed poseability for \r\nplaytime or display. Figure also includes a detachable Mjolnir hammer \r\naccessory<br>ICONIC SUPER HERO DESIGN AND DECO: Cool action figure \r\nfeatures classic Thor character design and deco that Marvel fans ages 4 \r\nand up know and love<br>ICONIC MARVEL AVENGERS PACKAGING: Each figure \r\ncomes in a package with a window that is great for gifting or \r\ndisplaying. Package features Marvel Avengers logo and design<br>HASBRO\'S\r\n EXCLUSIVE EPIC HERO SERIES: Avengers action figures are part of the \r\nEpic Hero Series 4-inch figures collection where toys are all compatible\r\n so kids can create their own heroic adventures inspired by the Marvel \r\nUniverse! (Each sold separately. Subject to availability.)<br><br>Ages 4 and up.<br>WARNING: Small parts.<br>Includes figure and accessory.</p>', 9.99, 0.80, 9.19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/EMmWsAU3ccBZsULe1NlP.png', 1, 1, NULL, '2024-04-18 13:20:04', '2024-04-18 13:20:04'),
(34, 'Marvel Stunt Squad Hulk vs. Abomination Playset with Action Figures (1.5)', 'marvel-stunt-squad-hulk-vs-abomination-playset-with-action-figures-1-5-', NULL, '<p>Mighty heroes, mega attitude! Marvel Stunt Squad Hulk vs. Abomination \r\nPlayset is a gamified action figures set that kids will love.</p>', '<p>Mighty heroes, mega attitude! Marvel Stunt Squad Hulk vs. Abomination \r\nPlayset is a gamified action figures set that kids will love. With \r\nfavorite Marvel characters in a classic hero versus villain play \r\npattern, these small scale super hero figures are full of dynamic poses \r\nand action-packed fun! Marvel Stunt Squad Hero vs. Villain Playsets \r\ninclude two 1-inch-scale figures, a launcher, and a target base. \r\nCopyright 2023 MARVEL Hasbro and all related terms are trademarks of \r\nHasbro.<br><br>HULK VS. ABOMINATION: Kids 4 and up can pretend to \r\ncreate the ultimate showdown between Hulk and Abomination with this \r\nMarvel playset<br>INCLUDES 2 FIGURES AND PLAYSET: Playset includes \r\n1.5-inch Marvel super hero and villain action figures, a launcher, and a\r\n target base<br>READY, AIM, LAUNCH!: Place Marvel Stunt Squad super \r\nhero action figure on launcher, aim at the target, and launch toy into \r\naction for crash and bash fun<br>DIFFERENT WAYS TO PLAY: Kids will \r\nenjoy the immersive, gamified learning experience while discovering \r\ntheir own unique play patterns with this Marvel Stunt Squad playset! \r\nPlay alone, or have friends and family join in on the fun<br>COLLECT \r\nALL MARVEL STUNT SQUAD FIGURES AND PLAYSETS: All Marvel Stunt Squad \r\naction figure toys are compatible with each playset (Each sold \r\nseparately. Subject to availability.)<br><br>Ages 4 and Up <br>WARNING: Small parts may be generated. Not for children under 3 years.<br>Includes: 2 figures, 1 launcher, and playset</p>', 9.99, 0.80, 9.19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,