(36, 'Marvel Avengers Epic Hero Series Iron Man 4\" Action Figure for Kids 4+', 'marvel-avengers-epic-hero-series-iron-man-4-action-figure-for-kids-4-', NULL, '<p>United to battle the foes no single hero could withstand, The Avengers are the most powerful Super Hero team in the world.</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">United\r\n to battle the foes no single hero could withstand, The Avengers are the\r\n most powerful Super Hero team in the world. Kids can play as the \r\ntech-powered Avenger, Iron Man, with this 4-inch-scale action figure to \r\nimagine hero versus villain battles. Iron Man toy features multiple \r\npoints of articulation and classic design and deco so toy figures can be\r\n posed for playtime or for display. A character-inspired accessory is \r\nalso included for even more pretend action fun! Marvel action figures \r\ncome in a package with a window that is great for gifting or collecting.\r\n Look for more Marvel Avengers toys and gifts to build your own super \r\nhero toy collection! (Each sold separately. Subject to availability.)\r\n\r\nCopyright MARVEL. All trademarks and registered trademarks are the \r\nproperty of their respective owners.\r\nHasbro and all related terms are trademarks of Hasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">PLAY\r\n AS IRON MAN: Tony Stark suits up as the tech-powered Iron Man to battle\r\n his foes, as a member of Earths Mightiest Heroes, The Avengers<br>POSEABLE\r\n TOY FIGURE WITH ACCESSORY: This 4-inch Avengers action figure features \r\nmultiple points of articulation in the knees, elbows, shoulders, waist, \r\nand head for action-packed poseability for playtime or display. Figure \r\nalso includes a detachable character-inspired accessory<br>ICONIC SUPER\r\n HERO DESIGN AND DECO: Cool action figure features classic Iron Man \r\ncharacter design and deco that Marvel fans ages 4 and up know and love<br>ICONIC\r\n MARVEL AVENGERS PACKAGING: Each figure comes in a package with a window\r\n that is great for gifting or displaying. Package features Marvel \r\nAvengers logo and design<br>HASBRO\'S EXCLUSIVE EPIC HERO SERIES: \r\nAvengers action figures are part of the Epic Hero Series 4-inch figures \r\ncollection where toys are all compatible so kids can create their own \r\nheroic adventures inspired by the Marvel Universe! (Each sold \r\nseparately. Subject to availability.)<br><br>Ages 4 and up.<br>WARNING: Small parts.<br>Includes figure.</div><p></p>', 9.99, 0.80, 9.19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/A5UtTE5GGLYmqbnTt6yK.png', 1, 1, NULL, '2024-04-18 13:28:15', '2024-04-18 13:28:15'),
