(40, 'Hasbro Marvel Shang-Chi And The Legend Of The Ten Rings Brick Breaker Action Toy For Kids Age 4 And Up', 'hasbro-marvel-shang-chi-and-the-legend-of-the-ten-rings-brick-breaker-action-toy-for-kids-age-4-and-up', NULL, '<p>Smash open the Brick Breaker box to discover which mini-figures are waiting for kids imagination to make the story come alive!</p>', '<p class=\"text-xl break-words lg:text-xl md:text-lg font-proxima-regular\">Smash\r\n open the Brick Breaker box to discover which mini-figures are waiting \r\nfor kids imagination to make the story come alive! Join Shang-Chi and \r\nthe power of the legendary Ten Rings as he tangles with formidable foes!\r\n Shang-Chi was trained in many martial arts for the secretive Ten Rings \r\norganization. On his journey toward mastery, he is drawn into a powerful\r\n web and must confront the past he thought he left behind. Kids can \r\nimagine their own adventure to claim their destiny with this Brick \r\nBreaker box with mini- figures, inspired by the movie Shang-Chi And The \r\nLegend Of The Ten Rings, part of the Marvel Cinematic Universe.  2021 \r\nMARVEL  2021 HASBRO Hasbro and all related terms are trademarks of \r\nHasbro.\r\n\r\n\r\n</p><div id=\"descriptionBoxTwo\" class=\"lg:text-xl text-xl md:text-lg font-proxima-regular md:pt-[30px] pt-[5px] md:pl-[12.5%]\">BREAK\r\n OPEN THE FUN! The excitement begins by getting ready to break open the \r\nBrick Breaker box! With an adult holding the box, kids will chop open \r\nthe brick, just like Shang-Chi in the Marvel movie Shang-Chi And The \r\nLegend Of The Ten Rings!<br>SURPRISES INSIDE: With a great big downward\r\n strike, kids release five 2-inch mini-figure toys based on characters \r\nfrom the movie Shang-Chi And The Legend of the Ten Rings! When the box \r\nbreaks open, the fun continues!<br>MYSTERY REVEALED: Kids use their \r\npower to break out 5 mini-figures and imagine their own legendary \r\nstories. The box contains 5 mini-figure characters from the Marvel \r\nmovie. Collect all 21 mini-figures!<br>COLLECT THEM ALL: Will it be \r\nShang-Chi, Wenwu, Xialing, the mischief maker, or villain characters \r\nfrom the Marvel movie? Each Brick Breaker box contains one 2-inch hero \r\nor villain, 3 Ten Rings warriors, and one mythical creature, all \r\ninspired by the Marvel movie. (Additional figures each sold separately. \r\nSubject to availability.)<br><br>Ages 5 and up. <br>WARNING: CHOKING HAZARD  Small parts. Not for children under 3 years.<br>Includes: 5 mini-figures.</div><p></p>', 8.49, 0.68, 7.81, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/SwFsiY6jCAiYd3Uysgcy.png', 1, 1, NULL, '2024-04-18 13:38:19', '2024-04-20 05:11:25'),
