(43, 'WOODCHUCK USA Lighter & Bottle Opener Gift Set', 'woodchuck-usa-lighter-bottle-opener-gift-set', NULL, '<p><em style=\"border: 0px; vertical-align: baseline; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Variations in the woodgrain and color make each WOODCHUCK, USA lighter unique</span></em><br></p>', '<p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Give a gift that gives back to the planet with this WOODCHUCK USA lighter and bottle opener gift set. A lush tree is laser-engraved on the real wood emblems that adorn the classic Street Chrome lighter and coordinating bottle opener, which is perfectly sized for most wallets. Through Woodchuck USAs&nbsp;<a href=\"https://www.woodchuckusa.com/pages/buy-one-plant-one\" title=\"Woodchuck USA Buy One. Plant One.\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"border: 0px; vertical-align: baseline; text-decoration-line: underline; line-height: 20px; color: rgb(221, 18, 41);\">Buy One. Plant One.</a>&nbsp;program, a tree will be planted for every Woodchuck USA product sold  two of which are included in each remarkable gift set. Comes packaged in a gift box with a unique code that can be used to locate the tree associated with each product. For optimal performance, fill with Zippo lighter fuel.</p><ul style=\"margin-bottom: 20px; margin-left: 30px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Gift set includes: genuine Zippo windproof lighter and card-sized WOODCHUCK USA bottle opener</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\"><span style=\"border: 0px; vertical-align: baseline;\">All-metal construction with 100% wood emblems; windproof design works virtually anywhere</span></li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Refillable for a lifetime of use; for optimal performance, we recommend genuine Zippo fuel, flints and wicks</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Every windproof lighter is made in the USA; Lifetime guarantee that \"it works or we fix it free</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Each WOODCHUCK USA gift set is responsible for planting two trees to help restore and protect the forests of the world</li></ul><p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Gift Set Specs:</span></p><p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Height:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;3.25</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Width:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;0.85</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Depth:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;4.48</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Weight:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;0.29 lbs.</span></p>', 42.71, 4.27, 38.44