(44, 'WOODCHUCK USA Skull & Snake', 'woodchuck-usa-skull-snake', NULL, '<p><span style=\"border: 0px; vertical-align: baseline; font-weight: 700; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><em style=\"border: 0px; vertical-align: baseline;\">Variations in the woodgrain and color make each WOODCHUCK, USA lighter unique.</em></span><br></p>', '<p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline;\">Zippo, in partnership with WOODCHUCK, USA, and their</span>&nbsp;<span style=\"border: 0px; vertical-align: baseline;\">program, will plant one tree for every lighter sold. These lighter are created using laser-cut emblem designs, made from 100% real wood, that will help restore and protect the forests of the world. Consumers can use the special code in each box to learn where their trees are planted. This Street Chrome lighter incorporates birch and mahogany inlays to create a tonal silhouette of a snake slithering through a skull. Comes packaged in a gift box. For optimum performance, fill with Zippo lighter fuel.</span></p><ul style=\"margin-bottom: 20px; margin-left: 30px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Genuine Zippo windproof lighter with distinctive Zippo \"click\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">All WOODCHUCK, USA emblems are manufactured using 100% real wood</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">All metal construction; windproof design works vir