(45, 'Rick Rietveld', 'rick-rietveld', NULL, '<p><span style=\"color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">The iconic artistry of Rick Rietveld returns on this classic Black Matte lighter</span><br></p>', '<p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">The iconic artistry of Rick Rietveld returns on this classic Black Matte lighter. Inspired by the Day of the Dead, or Dia de los Muertos, the striking Color Image design features a skeletal Mariachi surfing among swirling flames. Comes packaged in a gift box. For optimal performance fill with Zippo lighter fuel.</p><ul style=\"margin-bottom: 20px; margin-left: 30px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Genuine Zippo windproof lighter with distinctive Zippo \"click\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">All metal construction; windproof design works virtually anywhere</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Refillable for a lifetime of use; for optimum performance, we recommend genuine Zippo fuel, flints, and wicks</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Made in USA; Lifetime guarantee that \"it works or we fix it free\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Fuel: Zippo lighter fuel (sold separately)</li></ul><p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Lighter&nbsp;Specs:</span></p><p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Height:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;2.25&nbsp;</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Width:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;0.5</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Depth:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;1.5</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Weight:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;2.0 oz.</span></p>', 33.95, 3.40, 30.55, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/VHN8HFflLQq2mtq6zaQ2.png', 1, 1, NULL, '2024-04-20 05:42:58', '2024-04-20 05:42:58'),
(46, 'Tactical Pouch and Black Crackle Windproof Lighter Gift Set', 'tactical-pouch-and-black-crackle-windproof-lighter-gift-set', NULL, '<p><span style=\"color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Durable, versatile and American-made, this lighter and pouch gift set is perfect for any active lifestyle.&nbsp;</span><br></p>', '<p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Durable, versatile and American-made, this lighter and pouch gift set is perfect for any active lifestyle. The classic windproof lighter comes in the iconic Black Crackle finish, which gained notoriety during World War II, and pairs handsomely with the military-inspired Tactical Pouch, which holds the lighter securely and works with MOLLE and other cargo systems. Set is available with Black, OD Green or Coyote colored pouches. Comes packaged in a gift box. For optimal performance, fill with Zippo lighter fuel.</p><ul style=\"margin-bottom: 20px; margin-left: 30px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Gift set includes: genuine Zippo windproof lighter and nylon lighter pouch</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">All-metal lighter construction; windproof design works virtually anywhere.</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Refillable for a lifetime of use; for optimal performance, we recommend genuine Zippo fuel, flints and wicks</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Every windproof lighter is made in the USA; Lifetime guarantee that \"it works or we fix it free\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Pouch is made in the USA with military-spec materials; hook-and-loop closure</li></ul>', 42.95, 4.29, 38.66, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Q8xNG9b6RRTcdm8ro1lF.png', 1, 1, NULL, '2024-04-20 05:57:38', '2024-04-20 05:57:38'),
