(49, 'Carol Cavalaris', 'carol-cavalaris', NULL, '<p><span style=\"color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Digital and fine artist Carol Cavalaris celebrates the uniqueness of every living being.</span><br></p>', '<p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Digital and fine artist Carol Cavalaris celebrates the uniqueness of every living being with her extensive, mixed-media body of work, often blending reality and fantasy together in what she calls living art. Her piece, White Tiger  Spirit of Sensuality, comes to life in a vibrant Color Image design on this gleaming High Polish Blue lighter. Comes packaged in a gift box. For optimal performance fill with Zippo lighter fuel.</p><ul style=\"margin-bottom: 20px; margin-left: 30px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Genuine Zippo windproof lighter with distinctive Zippo \"click\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">All metal construction; windproof design works virtually anywhere</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Refillable for a lifetime of use; for optimum performance, we recommend genuine Zippo fuel, flints, and wicks</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Made in USA; Lifetime guarantee that \"it works or we fix it free\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Fuel: Zippo lighter fuel (sold separately)</li></ul><p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">Lighter&nbsp;Specs:</span></p><p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Height:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;2.25&nbsp;</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Width:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;0.5</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Depth:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;1.5</span><br><span style=\"border: 0px; vertical-align: baseline; font-weight: 700;\">&nbsp; &nbsp; &nbsp;Weight:</span><span style=\"border: 0px; vertical-align: baseline;\">&nbsp;2.0 oz.</span></p>', 38.95, 3.90, 35.05, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/1r6yNHgwhcaOtxdBwoBV.png', 1, 1, NULL, '2024-04-20 06:08:33', '2024-04-20 06:08:33');
