(51, 'LIPS / LIP GLOSS / LIPGLASS CLEAR', 'lips-lip-gloss-lipglass-clear', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; font-size: 36px; text-transform: uppercase; background-color: rgb(250, 250, 250);\">MIRROR-LIKE SHINE, CONDITIONING, ICONIC</span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; background-color: rgb(250, 250, 250);\">A unique lip gloss that can create a glass-like finish or a subtle sheen. Designed to be worn on its own, over lip pencil or lipstick, it\'s the perfect product for creating shine that lasts. It contains jojoba oil to help soften and condition the lips. A tiny bead of this highly concentrated product is all that\'s needed to cover the lip area. Clear Lipglass can be mixed with other products like pigments, and can be applied anywhere on the body except for the eye area to create interesting effects.<br></span><br></p><ul class=\"product-overview--right-column js-prod-overview-right-col\" data-sku-base-id=\"5044\" aria-label=\"Product overview\" style=\"--pr-translate-x: 0; --pr-translate-y: 0; --pr-rotate: 0; --pr-skew-x: 0; --pr-skew-y: 0; --pr-scale-x: 1; --pr-scale-y: 1; --pr-pan-x: ; --pr-pan-y: ; --pr-pinch-zoom: ; --pr-scroll-snap-strictness: proximity; --pr-ordinal: ; --pr-slashed-zero: ; --pr-numeric-figure: ; --pr-numeric-spacing: ; --pr-numeric-fraction: ; --pr-ring-inset: ; --pr-ring-offset-width: 0px; --pr-ring-offset-color: #fff; --pr-ring-color: rgba(59,130,246,.5); --pr-ring-offset-shadow: 0 0 transparent; --pr-ring-shadow: 0 0 transparent; --pr-shadow: 0 0 transparent; --pr-shadow-colored: 0 0 transparent; --pr-blur: ; --pr-brightness: ; --pr-contrast: ; --pr-grayscale: ; --pr-hue-rotate: ; --pr-invert: ; --pr-saturate: ; --pr-sepia: ; --pr-drop-shadow: ; --pr-backdrop-blur: ; --pr-backdrop-brightness: ; --pr-backdrop-contrast: ; --pr-backdrop-grayscale: ; --pr-backdrop-hue-rotate: ; --pr-backdrop-invert: ;