(54, 'Alien Attack Design', 'alien-attack-design', NULL, '<p><span style=\"color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Extraterrestrial travelers make a not-so-subtle entrance on this otherworldly Black Matte lighter.</span><br></p>', '<p style=\"margin-bottom: 20px; border: 0px; vertical-align: baseline; line-height: 20px; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\">Extraterrestrial travelers make a not-so-subtle entrance on this otherworldly Black Matte lighter. Our Color Image process depicts a friendly pair of aliens kindly asking some Earthlings for directions to the Zippo/Case Museum in this wholesome two-sided design. Comes packaged in a gift box. For optimal performance, fill with Zippo lighter fuel.</p><ul style=\"margin-bottom: 20px; margin-left: 30px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: rgb(102, 102, 102); font-family: Lato, sans-serif;\"><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Genuine Zippo windproof lighter with distinctive Zippo \"click\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">All-metal construction; windproof design works virtually anywhere</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Refillable for a lifetime of use; for optimal performance, we recommend genuine Zippo fuel, flints and wicks</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Made in USA; Lifetime guarantee that \"it works or we fix it free\"</li><li style=\"margin-bottom: 5px; padding-left: 10px; border: 0px; font-size: 16px; vertical-align: baseline; line-height: 20px;\">Fuel: Zippo lighter fuel (sold separately)</li></ul><