(59, 'Logitech Pebble 2 Combo for Mac Wireless Keyboard and Mouse, Slim', 'logitech-pebble-2-combo-for-mac-wireless-keyboard-and-mouse-slim', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Quiet and Portable, Customizable, Bluetooth Mouse and Keyboard, Easy-Switch, for macOS, iPadOS - Tonal Graphite</span></h1>', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Defy Boring: With a slim design, multiple colors and smarter tech, this keyboard and mouse from the Pebble 2 Collection lets you express your vibe and make your statement</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Why Not Have Both?: This ultra-slim and portable mouse and keyboard combo  made with recycled plastic (1)  is lightweight and compact to be ready to move when you are</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Easily Hop Across 3 Devices: Use Bluetooth to connect up to 3 wireless Apple devices across OSs (macOS, iPadOS, iOS (2)) with a press of a button</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Save Time &amp; Customize Your Way: Instantly access search, screen capture, and more with Fn keys; personalize the 10 Fn keys and the mouses middle button with Logi Options+ App (2)</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Make a Big Impression on the Quiet: Let your work speak louder than your typing and clicking with the keyboard\'s quiet, laptop-like typing and the mouse\'s Silent Touch Technology (3)</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Go for Longer: This combo for Mac gives you hours of use with the Bluetooth keyboard coming with a 3-year battery(5) and the mouse with a 2-year battery(5); batteries included.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">A Design Choice to Feel Good About: Plastic parts include certified post-consumer recycled plastic (1); Pebble Keys 2 K380s for Mac minimum 49% and Pebble Mouse 2 M350s minimum 58%</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Responsibly-sourced packaging: The packaging of Pebble 2 Combo for Mac (including product wrap) comes from FSC-certified forests and other controlled sources; certified carbon neutral.</span></li></ul>', 48.90, 4.89, 44.01, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/7npVIDLy4TAxyoAgNsMU.png', 1, 1, NULL, '2024-04-20 07:04:21', '2024-04-20 07:58:36'),
(60, 'LIPS / LIP BALM+ PRIMER / LIP CONDITIONER (TUBE)', 'lips-lip-balm-primer-lip-conditioner-tube-', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; font-size: 36px; text-transform: uppercase; background-color: rgb(250, 250, 250);\">HYDRATING, NOURISHING, CONDITIONING</span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; background-color: rgb(250, 250, 250);\">An emollient-based balm that conditions lips and locks in moisture. It acts as a perfect base for lipsticks and helps lip pencils to glide on. Worn on its own, it imparts a soft shine to the lips.<br></span><br></p><ul class=\"product-overview--right-column js-prod-overview-right-col\" data-sku-base-id=\"4920\" aria-label=\"Product overview\" style=\"--pr-translate-x: 0; --pr-translate-y: 0; --pr-rotate: 0; --pr-skew-x: 0; --pr-skew-y: 0; --pr-scale-x: 1; --pr-scale-y: 1; --pr-pan-x: ; --pr-pan-y: ; --pr-pinch-zoom: ; --pr-scroll-snap-strictness: proximity; --pr-ordinal: ; --pr-slashed-zero: ; --pr-numeric-figure: ; --pr-numeric-spacing: ; --pr-numeric-fraction: ; --pr-ring-inset: ; --pr-ring-offset-width: 0px; --pr-ring-offset-color: #fff; --pr-ring-color: rgba(59,130,246,.5); --pr-ring-offset-shadow: 0 0 transparent; --pr-ring-shadow: 0 0 transparent; --pr-shadow: 0 0 transparent; --pr-shadow-colored: 0 0 transparent; --pr-blur: ; --pr-brightness: ; --pr-contrast: ; --pr-grayscale: ; --pr-hue-rotate: ; --pr-invert: ; --pr-saturate: ; --pr-sepia: ; --pr-drop-shadow: ; --pr-backdrop-blur: ; --pr-backdrop-brightness: ; --pr-backdrop-contrast: ; --pr-backdrop-grayscale: ; --pr-backdrop-hue-rotate: ; --pr-backdrop-invert: ; --pr-backdrop-opacity: ; --pr-backdrop-saturate: ; --pr-backdrop-sepia: ; list-style: none; margin-top: 3px; margin-bottom: 0px; padding-left: 73px; width: auto; flex: 1 1 0%; color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; font-size: 15px; background-co