(61, 'LIPS / LIP BALM+ PRIMER / LIP SCRUBTIOUS', 'lips-lip-balm-primer-lip-scrubtious', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; font-size: 36px; text-transform: uppercase; background-color: rgb(250, 250, 250);\">EXFOLIATING, HYDRATING, 3 FLAVOURS</span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; background-color: rgb(250, 250, 250);\">Pucker up! Get totally smooth lips with MAC Lip Scrubtious. This sugar-based exfoliator gently buffs away dry and flaky skin, with a formula enhanced by hydrating and nourishing conditioners leaving lips soft and oh-so-smoochable. Available in three flavours including Candied Nectar, Fruit of Passion and Sweet Vanilla.<br></span></p><ul class=\"product-overview--right-column js-prod-overview-right-col\" data-sku-base-id=\"76952\" aria-label=\"Product overview\" style=\"--pr-translate-x: 0; --pr-translate-y: 0; --pr-rotate: 0; --pr-skew-x: 0; --pr-skew-y: 0; --pr-scale-x: 1; --pr-scale-y: 1; --pr-pan-x: ; --pr-pan-y: ; --pr-pinch-zoom: ; --pr-scroll-snap-strictness: proximity; --pr-ordinal: ; --pr-slashed-zero: ; --pr-numeric-figure: ; --pr-numeric-spacing: ; --pr-numeric-fraction: ; --pr-ring-inset: ; --pr-ring-offset-width: 0px; --pr-ring-offset-color: #fff; --pr-ring-color: rgba(59,130,246,.5); --pr-ring-offset-shadow: 0 0 transparent; --pr-ring-shadow: 0 0 transparent; --pr-shadow: 0 0 transparent; --pr-shadow-colored: 0 0 transparent; --pr-blur: ; --pr-brightness: ; --pr-contrast: ; --pr-grayscale: ; --pr-hue-rotate: ; --pr-invert: ; --pr-saturate: ; --pr-sepia: ; --pr-drop-shadow: ; --pr-backdrop-blur: ; --pr-backdrop-brightness: ; --pr-backdrop-contrast: ; --pr-backdrop-grayscale: ; --pr-backdrop-hue-rotate: ; --pr-backdrop-invert: ; --pr-backdrop-opacity: ; --pr-backdrop-saturate: ; --pr-backdrop-sepia: ; list-style: none; margin-top: 3px; margin-bottom: 0px; padding-left: 73px; width: auto; flex: 1 1 0%; co