(62, 'Logitech K380 Pebble Multi-Device Bluetooth Keyboard', 'logitech-k380-pebble-multi-device-bluetooth-keyboard', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Windows, Mac, Chrome OS, Android, iPad, iPhone, Apple TV Compatible  with Flow Cross-Computer Control and Easy-Switch up to 3 Devices Dark Grey</span></h1>', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Multi-device Bluetooth keyboard: The Logitech K380 Pebble keyboard is a universal keyboard for typing on all your computing devices: Windows, Mac, Chrome OS, Android, iPad, iPhone, Apple TV 2nd or 3rd generation</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Easy-switch: Connect up to 3 devices simultaneously and switch between them at the touch of button. Wireless range 10 meter</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Logitech flow cross-computer typing: Use as a regular keyboard or combine with a compatible Logitech flow mouse (sold separately) to type, copy, paste and move files seamlessly between computers</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Compact mobile keyboard: Easy to carry around your home for familiar typing in any room and Logitech options for Windows (Windows 7, Windows 8, Windows 10 or later), Logitech options for Mac (OS X 10.8 or later)</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">OS adaptive: Automatically recognizes each device and maps keys to give you a familiar layout, including shortcuts. Battery life (not rechargeable) - 24 months. Connection type: Bluetooth classic (3.0)</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">2 year battery life: Virtually eliminates the need to change batteries (Keyboard battery life calculation based on an estimated 2 million keystrokes/year in an office environment. User experience may vary.)</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">1 Year Limited Hardware Warranty</span></li></ul></h1>', 39.99, 4.00, 35.99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/1cPLfJKsJfCrGx4hH89S.png', 1, 1, NULL, '2024-04-20 07:18:41', '2024-04-20 07:52:34'),
(63, 'MACSTACK SNOW STACK', 'm-a-cstack-snow-stack', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; font-size: 36px; text-transform: uppercase; background-color: rgb(250, 250, 250);\">LIMITED EDITION, MACSTACK MEGA MASCARA, EXCLUSIVE WHITE HUE</span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: ano_regular, Helvetica, Arial, sans-serif; background-color: rgb(250, 250, 250);\">Snow Stack on infinite layers of icy haute volume + length with MACStack Mega Mascara in a new snowy shade for a limited time only. Play it cool while serving white-hot looks all winter and beyond. This trending continuously buildable, clump-resistant formula gives you customizable gravity-defying volume from natural to next-level, along with instant lash lift and length guaranteed to garner chills.<br></span><br></p><ul class=\"product-overview--right-column js-prod-overview-right-col\" data-sku-base-id=\"181915\" aria-label=\"Product overview\" style=\"--pr-translate-x: 0; --pr-translate-y: 0; --pr-rotate: 0; --pr-skew-x: 0; --pr-skew-y: 0; --pr-scale-x: 1; --pr-scale-y: 1; --pr-pan-x: ; --pr-pan-y: ; --pr-pinch-zoom: ; --pr-scroll-snap-strictness: proximity; --pr-ordinal: ; --pr-slashed-zero: ; --pr-numeric-figure: ; --pr-numeric-spacing: ; --pr-numeric-fraction: ; --pr-ring-inset: ; --pr-ring-offset-width: 0px; --pr-ring-offset-color: #fff; --pr-ring-color: rgba(59,130,246,.5); --pr-ring-offset-shadow: 0 0 transparent; --pr-ring-shadow: 0 0 transparent; --pr-shadow: 0 0 transparent; --pr-shadow-colored: 0 0 transparent; --pr-blur: ; --pr-brightness: ; --pr-contrast: ; --pr-grayscale: ; --pr-hue-rotate: ; --pr-invert: ; --pr-saturate: ; --pr-sepia: ; --pr-drop-shadow: ; --pr-backdrop-blur: ; --pr-backdrop-brightness: ; --pr-backdrop-contrast: ; --pr-backdrop-grayscale: ; --pr-backdrop-hue-rotate: ; --pr-backdrop-invert: ; --pr-backdrop-opacity: ; --pr-backdrop-saturate: ; --pr-backdrop-sepia: ; list-style: none; margin-to