(67, 'Rapoo Bluetooth Wireless Mouse', 'rapoo-bluetooth-wireless-mouse', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Multi-Device (3 Bluetooth+USB) Programmable Ergonomic Mouse with Side Roller&nbsp;</span></h1>', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Multi-device Wireless MouseThe pioneering bluetooth technology and USB receiver provide stable connection for the RAPOO mouse, working distance up to 10m. Plug and Play, just short press switch button to quickly swith between 4 devices such as PC, laptop, MacBook and iPad. Automatic connection after switching, saving a lot of time. With a display screen, which clearly shows the connection status.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Adjustable DPI &amp; Laser MouseRAPOO bluetooth mouse has 8 efficient buttons, 4 DPI (600/1200/1600/3200) that allow you to freely control the mouse speed and adjusts the sensitivity of the mouse. Tracks virtually anywhere even on glass or high gloss surfaces. Compared to the traditional optical mouse, the laser mouse can be more accurate positioning, which is very suitable for professionals to use.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Rechargeable &amp; ProgrammableBuilt-in 800mAh Li-ion rechargeable battery, the wireless bluetooth mouse can be easily recharged via USB-B cable. 3 hours quick fully charged can lasts up to 30 days, standby time is super long. Low battery indicator will remind you to charge when flashing red light. 8 buttons are programmable, can be customized by driver.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Ergonomics Design &amp; Side rollerThe wireless mouse designed for right-handed user, palm and thumb rest provides better support. By using the middle scroll wheel and the side scroll wheel, you can move up, down, left, and right on the page. More efficient during using wireless mouse for AutoCAD, revit, excel, and Adobe graphic Edition software.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">One year Warranty &amp; 30 days Return RAPOO is an international brand,all the products are provides 30 days money-back and 12-month worry-free warranty. **Please charge the mouse before using it. **Please feel free to contact us if you have any questions.</span></li></ul>', 39.99, 4.00, 35.99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/weWTWaPgdY4UG1rbC4rd.png', 1, 1, NULL, '2024-04-20 07:44:13', '2024-04-20 07:44:13');
