(70, 'Logitech 910005592 M720 Triathalon Multi-Device Wireless Mouse - Black', 'logitech-910005592-m720-triathalon-multi-device-wireless-mouse---black', NULL, '<p><span style=\"color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\">Dual Connectivity -Connect via Bluetooth or the wireless Logitech Unifying receiver.</span><br></p>', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Designed for endurance with up to 24-month battery life, M720 is compatible with computers, laptops and tablets, Windows, macOS, Chrome OS, Linux, and iPadOS</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Comfortable Grip -Crafted for the right hand, this full-sized wireless PC mouse features a rubber body and a sculpted design for palm rest grip and comfort like never before</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Hyper-Fast Scrolling -Fly through long documents and web pages with a simple spin of the mouse wheel with the additional instant-stop feature and an option to switch to click-to-click scrolling.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Dual Connectivity -Connect via Bluetooth or the wireless Logitech Unifying receiver, which lets you connect up to 6 compatible Logitech peripherals with only 1 USB receiver.</span></li></ul>', 38.40, 3.84, 34.56, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/fil