(73, 'UBOTIE Colorful Computer Wireless Keyboard Mouse Combo', 'ubotie-colorful-computer-wireless-keyboard-mouse-combo', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Typewriter Flexible Keys Office Full-Sized Keyboard, 2.4GHz Dropout-Free Connection and Optical Mouse (Black-Colorful)</span></h1>', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">GORGEOUS COLOR DESIGN &amp; NEVER FADE OFFEach one is designed with multicolor to help you be distinctive in the office. And you will not worry the color will fade anymore from this 2024 new arrival version</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">&nbsp;RETRO ROUND KEYCAPSDo you keep your grandpa\'s typewriter? You will find some memories from this adorable keyboard</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">UNIQUE MIRROR PLANEIf you got it, you will find every key has a reflection on the keyboard pad, just do not forget to keep it clean</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">SIMPLE SETUP&amp;AUTO POWER-SAVINGInsert the USB receiver, and then you can use this keyboard, it supports Windows 7, Windows 8, Windows 10, and Mac</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">ANY REPLACEMENT&amp;REFUND WILL BE RESPONDED IN 12HrsThis product comes with one year of free replacement service encounter any problems please consult our 24-hour service in using a manual and there will be a brand new one waiting for you</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">&nbsp;CONNECTION ISSUESUsually the USB receiver is put near the mouse battery slot not in the keyboard battery slot, and this colorful wireless keyboard and mouse set share one USB nano. If there are any connection issues( such as the mouse not working or keyboard not working) please feel free to let us know</span></li></ul>', 31.59, 3.16, 28.43, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/i2CTG4bHqkHxVmxYXRmd.png', 1, 1, NULL, '2024-04-20 08:21:05', '2024-04-20 08:21:05');
