(82, '2.4GHz Wireless Gaming Headset for PC', '2-4ghz-wireless-gaming-headset-for-pc', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Nintendo Switch, Bluetooth 5.2 Gaming Headphones with Noise Canceling Microphone, Stereo Sound, ONLY 3.5mm Wired Mode for Xbox Series-White</span></h1>', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Stable Connection &amp; Stereo Sound: Gtheos Captain 300 wireless gaming headset combines high performance 2.4GHz lossless wireless technology for the accessible connection up to 49 feet in an unobstructed space. Lower latency (20ms) and featuring 50mm driver with 30% extra sound effect ensure that the wireless gaming headphones provide higher quality stereo sound, which makes you sense voice of directions, footsteps and every details clearly in games for a better immersive gaming experience.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">&nbsp;Detachable Omni-directional Noise-reduction Microphone: Captain 300 wireless ps5 headset combines detachable, flexible, sensible and omni-directional microphone, providing high-end noise cancellation, which not only can be adjusted to the angles you want, also enables you to chat with your teammates with crystal clarity dialogue by this bluetooth gaming headset to coordinate with every scene of your game. Enhancing your ability to triumph in battles by this PS5 gaming headset.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">&nbsp;3-in-1 Connection Ways &amp; Multi-platform Compatibility: Captain 300 wireless pc headset supports low latency, lossless 2.4GHz USB dongle and the latest Bluetooth 5.2 stable connection, while supporting 3.5mm wired connection mode. Unique 3 in 1 connection design (equipped with both USB dongle and 3.5mm jack cable) make this wireless headset widely compatible with PS5, PS4, PC, Mac, phone, pad, Nintendo Switch(Invalid Microphone); Xbox series only compatible with 3.5mm wired mode.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">&nbsp;Ergonomic Design &amp; Long-lasting Battery Life: Gtheos wireless headset for switch design padded adjustable headbands not only good for reducing head pressure but also suitable for various head shapes. Ears are completely covered by soft and breathable memory-protein earmuffs that isolate noises effectively and allow for long gaming sessions without fatigue. This ps5 headset has a sustainable game time of 35-40Hrs. With cool RGB lighting effect turned on(15-20Hrs). Full-recharge in just 3Hrs.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">&nbsp;Fashion Mirror Surface Design &amp; Professional Services: Gtheos gaming headset wireless is made of high-quality and durable materials. With stylish mirror surface design of the playstation 5 base color, after detaching the microphone, it is not only a wireless gaming headset for pc, but also a suitable multi-scene (subway, home, going out) bluetooth gaming headphones. Meantime, we have experienced engineers and professional support team to provide comprehensive help for each customer.</span></li></ul>', 39.99, 4.00, 35.99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/ubXFDJe0aeuUGCUrdDR0.png', 1, 1, NULL, '2024-04-20 08:57:52', '2024-04-20 08:57:52'),
(83, 'King C. Gillette Beard Care Kit', 'king-c-gillette-beard-care-kit', NULL, '<div class=\"top-short-description\" style=\"font-family: latoregular, Arial, sans-serif; margin-top: 10px; margin-bottom: 20px; font-size: 15px; color: rgb(94, 94, 94); line-height: 24px; max-width: 380px;\">Trim, wash and soften your beard with the King C. Gillette Beard Care Kit.</div><div class=\"top-short-description\" style=\"font-family: latoregular, Arial, sans-serif; margin-top: 10px; margin-bottom: 20px; font-size: 15px; color: rgb(94, 94, 94); line-height: 24px; max-width: 380px;\">The King C. Gillette Beard Care Kit includes: 1 Beard, Face &amp; Hair Wash, 1 Beard Oil and 1 Beard Softener.</div>', '<p>The King C. Gillette 3in1 Beard, Face &amp; Hair Wash uses our patented hair conditioning technology to cleanse and condition hair and skin. It\'s suitable for all hair types and beard styles, ensuring an easy and thorough wash with every use. This multifunctional formula cleanses, purifies and conditions facial hair, leaving you with a clean, fresh beard that stays healthy looking, even hours after washing.</p><p><br></p><p>The King C. Gillette Beard Oil works to moisturize the skin underneath your beard and also condition your facial hair, leaving it healthy, soft and shiny. This formula with argan oil is suitable for all hair types, regardless of the length, style or shape. Its also formulated to work effectively for different skin types, ensuring that the product tames facial hair while soothing bumpy, itchy and irritated skin.</p><p><br></p><p>The King C. Gillette Beard Softener deeply hydrates and softens all facial hair types, without weighing it down. It can be used as a conditioner, leave-on treatment, or wash-off mask. This multifunctional hair softener conditions hair to hydrate and soften it, leaving behind a light, and tame beard. It has a lightweight formula, and its texture is easy to spread and work into your beard.</p>', 30.00, 3.00, 27.00, NULL, NULL, NULL, NU