(85, 'King C. Gillette All-in-One Styler Blade', 'king-c-gillette-all-in-one-styler-blade', NULL, '<p>&nbsp;Refill with 4-Directional Metal Razor Blades, 1 Refill<br></p>', '<p>King C. Gillette All-in-one Styler Blades are replaceable, full metal blades that last for up to 6 months of close shaves. These blades are compatible with the King C. Gillette All-in-one Styler Cordless Trimmer, which is a versatile tool in the King C. Gillette lineup designed to help guys edge, trim and stubble. The Styler Blades are equipped with 4D-Blade Technology that allows for fast, easy, and comfortable shaving strokes in up, down, or side-to-side directions.</p><p><br></p><p>4D Blade for easy, fast, and comfortable shaving strokes in 4 directions: up, down, or side-to-side</p><p>Compatible with the King C. Gillette Style Master Cordless Trimmer</p><p>Long Lasting Blade: Replaceable, long-lasting blade that stays sharp for up to 6 months of close shaves</p><p>Designed specifically to help men with stubble have comfortable, stylish beards, but also a great tool to discover new beard styles and master every one</p><p>The King C. Gillette line includes a complete set of precision tools and quality care products, to enable every man to create his own unique style</p>', 20.00, 2.00, 18.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/ofr0LxGo656prWUcvjpy.png', 1, 1, NULL, '2024-04-20 09:46:29', '2024-04-20 09:46:29'),
(86, 'Gillette INTIMATE Pubic Hair Trimmer', 'gillette-intimate-pubic-hair-trimmer', NULL, '<p><span style=\"color: rgb(94, 94, 94); font-family: latoregular, Arial, sans-serif; font-size: 15px;\">Gillette INTIMATE Pubic Hair Trimmer for Men, SkinFirst Pubic Hair Trimmer For Men, Waterproof, Cordless For Wet/Dry Use, Shaver For Men, Lifetime Sharp Blades</span><br></p>', '<ul style=\"font-family: latoregular, Arial, sans-serif; margin-bottom: 0px; list-style: none; width: 520px; color: rgb(51, 51, 51); font-size: 14px;\"><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">GILLETTE INTIMATE PUBIC HAIR TRIMMER</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Engineered to be tough on hair, gentle on intimate skin</div></div></li><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">DESIGNED TO MINIMIZE IRRITATION</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">With closely spaced blades that help reduce skin bulging and help protect intimate skin</div></div></li><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">PROTECTIVE COMB</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Designed for your comfort. Equipped with an attachable protective comb to minimize contact with the blade</div></div></li></ul><ul style=\"margin-bottom: 0px; list-style: none; width: 520px;\"><li style=\"color: rgb(51, 51, 51); font-family: latoregular, Arial, sans-serif; font-size: 14px; margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">WATERPROOF AND CORDLESS</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Get up to 100 minutes of cordless trimming with the powerful Li-Ion battery</div></div></li><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"color: rgb(24, 47, 110); font-family: latobold, arial, &quot;sans-serif&quot;; font-size: 16px; margin-bottom: 15px; line-height: 18px;\">DERMATOLOGIST TESTED</div><div class=\"text blades\" style=\"line-height: 24px;\"><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\">Gentle on delicate pubic skin. Effortless and easy, elevate your hygiene care routine</font><br><br><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\">Meet Gillette\'s gentle and easy intimate shaving lineup that shows the proper respect for your region. Gillette INTIMATE Pubic Hair Trimmer is Gillettes first pubic hair trimmer for men, designed for gentle and easy grooming below the waist. Trim the hair with the 3 interchangeable skin-shielding guards. This electric pubic trimmer is cordless and has SkinFirst technology with closely spaced blades to reduce the risk to nick and cut the delicate skin. Powered by Braun, this electric pubic hair trimmer is equipped with a powerful Li-Ion rechargeable battery that lasts up to 100 minutes from a single charge. This waterproof pubic hair trimmer can be used wet or dry, so you can easily trim at the sink or in the shower. It comes with a charger, 3 lengths of interchangeable guards. With Gillette INTIMATE Grooming, you have a routine so simple and easy that you won\'t need to plan ahead. For a complete intimate grooming routine, use the entire Gillette Intimate grooming line to help prepare, help protect pubic hair from shave irritation, and maintain your pubic hair &amp; skin.</font><br></div></div></li></ul>', 60.00, 6.00, 54.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/KN889sAjlJrpekgNtpGy.png', 1, 1, NULL, '2024-04-20 09:52:35', '2024-04-20 09:52:35'),
(87, 'SkinGuard Razor, 1 Handle and 8 Razor Blade Refills', 'skinguard-razor-1-handle-and-8-razor-blade-refills', NULL, '<div class=\"featuresTitle\" style=\"font-family: lato_blackregular, Arial, sans-serif; color: rgb(24, 47, 110); text-align: center; font-size: 30px; line-height: 34px;\">SkinGuard Features</div><div class=\"featuresList\" style=\"font-family: latoregular, Arial, sans-serif; margin-top: 30px; display: flex; justify-content: space-between; align-items: center; -webkit-box-pack: justify; -webkit-box-align: center; color: rgb(51, 51, 51); font-size: 14px;\"><ul style=\"margin-bottom: 0px; list-style: none; width: 520px;\"><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"img\" style=\"width: 86px; height: 86px; display: flex;\"><img src=\"https://cdn11.bigcommerce.com/s-dukhrgn8mp/product_images/uploaded_images/fusionlubrication3.webp%22\" alt=\"\" style=\"border: 0px; display: inline-block; height: auto; max-width: 100%; object-fit: contain; object-position: center center;\"></div><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">FOR SENSITIVE SKIN</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Clinically proven and dermatologist tested for sensitive skin</div></div></li><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"img\" style=\"width: 86px; height: 86px; display: flex;\"><img src=\"https://cdn11.bigcommerce.com/s-dukhrgn8mp/product_images/uploaded_images/skinguard-skinguard.png?t=1593206080&amp;_ga=2.127175182.266860596.1592793746-1218024207.1592410121\" alt=\"\" style=\"border: 0px; display: inline-block; height: auto; max-width: 100%; object-fit: contain; obje