0%; object-fit: contain; object-position: center center;\"></div><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">IMPROVED LUBRICATION</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Features improved lubrication formula as well as a touch of aloe before and after the blades *vs prior Gillette SkinGuard</div></div></li><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"img\" style=\"width: 86px; height: 86px; display: flex;\"><img src=\"https://cdn11.bigcommerce.com/s-dukhrgn8mp/product_images/uploaded_images/fusionprecisiontrimmer.png?t=1593205986&amp;_ga=2.69158418.266860596.1592793746-1218024207.1592410121\" alt=\"\" style=\"border: 0px; display: inline-block; height: auto; max-width: 100%; object-fit: contain; object-position: center center;\"></div><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">PRECISION</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Precision blade on back of cartridges for sharp line up</div></div></li><li style=\"margin-bottom: 30px; display: flex; align-items: center; min-height: 94px; -webkit-box-align: center;\"><div class=\"img\" style=\"width: 86px; height: 86px; display: flex;\"><img src=\"https://cdn11.bigcommerce.com/s-dukhrgn8mp/product_images/uploaded_images/fusion-handle.png?t=1593205985&amp;_ga=2.98591133.266860596.1592793746-1218024207.1592410121\" alt=\"\" style=\"border: 0px; display: inline-block; height: auto; max-width: 100%; object-fit: contain; object-position: center center;\"></div><div class=\"content\" style=\"margin-left: 14px; width: 410px;\"><div class=\"title\" style=\"font-family: latobold, arial, &quot;sans-serif&quot;; margin-bottom: 15px; font-size: 16px; line-height: 18px; color: rgb(24, 47, 110);\">COMFORTABLE</div><div class=\"text\" style=\"font-size: 16px; line-height: 24px; color: rgb(94, 94, 94);\">Form-fitting handle for optimal control</div></div></li></ul></div>', '<p>The SkinGuard razor features two sharp, optimally-spaced blades to minimize tugging and pulling. Unlike most blades that cut hairs below the skin, SkinGuard\'s revolutionary guard technology gently positions the blades to cut hairs at skin level, helping to prevent new razor bumps and shaving irritation. This specialized technology is clinically proven for users with sensitive skin, providing a clean, comfortable shave. Gillette SkinGuard allows you to have the ideal blend of closeness and comfort while helping to protect against shave-related irritations. The lubrication, with a touch of aloe, is strategically placed both before and after the blades, delivering maximum comfort with each stroke. Crafted with a comfortable, form-fitting handle, this razor provides optimal control while shaving. Additionally, a precision blade on the razor\'s back allows you to perfect your lines and achieve a sharp, well-groomed look.<br></p>', 30.00, 3.00, 27.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/fM9J3sDxTC2XZ3v6iTSJ.png', 1, 1, NULL, '2024-04-20 10:03:35', '2024-04-20 10:03:35'),
(88, 'King C. Gillette Double Edge Safety Razor', 'king-c-gillette-double-edge-safety-razor', NULL, '<p><span style=\"color: rgb(94, 94, 94); font-family: latoregular, Arial, sans-serif; font-size: 15px;\">A single blade razor designed for edging sideburns and strong beard lines to help you achieve your perfect look.</span><br></p>', '<p>An Iconic Design with Ultimate Precision</p><p>A single blade razor designed for edging sideburns and strong beard lines to help you achieve your perfect look. Our closed comb design allows great control, while its high-quality handle is chrome-plated for better durability. Each Double Edge Safety Razor comes with 5 blades.</p>', 35.00, 3.50, 31.50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/3HapFmrM9LX5r91pa5xX.png', 1, 1, NULL, '2024-04-20 10:09:55', '2024-04-20 10:09:55'),
(89, 'Heated Razor Charging Case', 'heated-razor-charging-case', NULL, '<p><span style=\"color: rgb(94, 94, 94); font-family: latoregular, Arial, sans-serif; font-size: 15px;\">Take the heat with you with this premium charging case for your Heated Razor  travel safe and ready to use for any trip. *Razor not included.&nbsp;</span><br></p>', '<p>Recharge the Heat</p><p>This hard sided travel case will keep your Heated Razor charged and ready to use for any trip.</p><p><br></p><p>Features</p><p>Permitted in carry-on luggage</p><p>Magnetic case holds razor for charging*</p><p>Premium grade aluminum</p><p>Removable, washable tray</p><p>Uses Heated Razor smart plug charging cable (additional cable not included)</p><p>*Case must be plugged in to charge</p>', 50.00, 5.00, 45.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/YJcVZYu08ofSUtRtVs13.png', 1, 1, NULL, '2024-04-20 10:30:09', '2024-04-20 10:30:09'),
(90, 'ProGlide (Refills)', 'proglide-refills-', NULL, '<p><span style=\"color: rgb(94, 94, 94); font-family: latoregular, Arial, sans-serif; font-size: 15px;\">ProGlide Mens Razor Refills have five of our sharpest anti-friction blades that are closer together for a shave you can barely feel.</span><br></p>', '<p>For A Shave You Barely Feel</p><p>ProGlide Mens Razor Refills have five of our sharpest and thinnest (first 4 blades) anti-friction blades to get virtually every hair. The soft microfins on the blades help stretch and smooth your skin, while a microcomb helps guide your hair for a close shave. An even better Lubrastrip (vs. Fusion5) with more lubricants helps the blades easily glide across your skin.</p><p><br></p><p>Our ProGlide Blades also have a precision trimmer on the back of the blade for all those hard-to-reach spots. The trimmer is also perfect for styling facial hair. Plus, each razor refill lasts up to 20 shaves per blade refill.</p>', 20.00, 2.00, 18.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/ztg5FWjukFDl0fbZq2HD.png', 1, 1, NULL, '2024-04-20 10:38:12', '2024-04-20 10:38:12'),
(91, 'GilletteLabs with Exfoliating Bar Razor (1 Handle + 3 Cartridges + 1 Travel Case)', 'gillettelabs-with-exfoliating-bar-razor-1-handle-3-cartridges-1-travel-case-', NULL, '<p><span style=\"font-family: hind-regular, arial, sans-serif; letter-spacing: -0.13px;\"><font color=\"#f6f6f6\" style=\"background-color: rgb(0, 0, 0);\">GilletteLabs razor with built-in exfoliation technology, for effortless shaving in one efficient stroke. Includes</font><b style=\"\"><font color=\"#000000\" style=\"background-color: rgb(0, 0, 0);\"> </font></b><font color=\"#f6f6f6\" style=\"background-color: rgb(0, 0, 0);\">razor handle, 3 blade refills, magnetic stand, and travel case.</font></span><br></p>', '<p>EFFORTLESS SHAVING IN ONE EFFICIENT STROKE</p><p>GilletteLabs with Exfoliating Bar, Gillette\'s first razor with exfoliating technology built into the handle, helps remove dirt and debris before the blades pass for a close, smooth shave. The 2D FlexDisc\'s circular pivot technology maximizes the blade\'s contact with skin in every stroke, adapting to the contours of your face. This innovative design combined with the iconic 5-blade cartridges featuring 5 of Gillette\'s thinnest and finest blades* mounted on highly responsive springs. Once you\'re done grooming, simply dock your razor in a premium magnetic stand that keeps it clean, dry and ready to use.</p><p><br></p><p>The GilletteLabs with Exfoliating Bar is sturdy and durable, with a diecast zinc handle that is backed by lifetime warranty. Get fresh shaves whenever you need them with the GilletteLabs razor blade refills - compatible with both the GilletteLabs with Exfoliating Bar and the GilletteLabs Heated Razor. Experience the next evolution in male shaving and enjoy an elevated grooming experience with GilletteLabs.</p>', 30.00, 3.00, 27.00, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/qXQBe8vwVJ0vSmC8PQCs.png', 1, 1, NULL, '2024-04-20 10:44:56', '2024-04-20 10:44:56'),
(92, 'Fusion5 Blade Refills', 'fusion5-blade-refills', NULL, '<p><span style=\"color: rgb(94, 94, 94); font-family: latoregular, Arial, sans-serif; font-size: 15px;\">Gillette Fusion5 shaving razors for men feature 5 anti-friction blades for a shave you barely feel. The Precision Trimmer on the back is great for hard-to-reach areas and styling facial hair.</span><br></p>', '<p><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\"><span style=\"font-size: 15px;\">A Shave You Barely Feel</span></font></p><p><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\"><span style=\"font-size: 15px;\">Featuring five antifriction blades, Fusion5 men\'s razor provides a shave you barely feel. The lubrastrip glides the razor smoothly to maximize comfort, and fades to let you know it\'s time for a new blade.</span></font></p><p><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\"><span style=\"font-size: 15px;\"><br></span></font></p><p><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\"><span style=\"font-size: 15px;\">Get hard-to-reach hairs, and craft your style perfectly with the precision trimmer on the back of each cartridge. Soft microfins gently stretch and smooth skin to prepare hairs for a close shave from our thinnest blades. Get better control in wet conditions with an ergonomic handle designed to increase grip in the water.</span></font></p><p><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\"><span style=\"font-size: 15px;\"><br></span></font></p><p><font color=\"#5e5e5e\" face=\"latoregular, Arial, sans-serif\"><span style=\"font-size: 15px;\">Each handle fits all Gillette 5-blade razor refills (excluding GilletteLabs) and each refill lasts up to a month of shaves, letting you get the most out of every blade.</span></font></p>', 18.00, 1.80, 16.20, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/p0IhVFttixmg98JSG28T.png', 1, 1, NULL, '2024-04-20 10:46:48', '2024-04-20 10:46:48'),
(93, 'Dyson Purifier Cool Gen1 TP10 purifying fan (White)', 'dyson-purifier-cool-gen1-tp10-purifying-fan-white-', NULL, '<p class=\"typography-body product-hero__line2\" style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; color: rgb(51, 51, 51);\">Automatically senses, captures and traps pollutants. For cleaner air.</p><ul style=\"box-sizing: inherit; margin-bottom: 0px; font-family: DysonFutura, sans-serif; line-height: 1.5; color: rgb(51, 51, 51);\"><li style=\"box-sizing: inherit;\">Cools you</li><li style=\"box-sizing: inherit;\">Whole-room purification</li><li style=\"box-sizing: inherit;\">Removes 99.97% of particles as small as 0.3 microns</li></ul>', '<h3 class=\"text__heading h6\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; color: rgb(255, 255, 255); background-color: rgb(0, 0, 0);\">Senses and reports, automatically</h3><div class=\"text__body js-text-body typography-body--small\" data-label-target=\"Opens in new Window\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; margin-bottom: 0.5rem; line-height: 1.5; color: rgb(255, 255, 255); background-color: rgb(0, 0, 0);\"><p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: inherit; font-weight: inherit; font-size: inherit; line-height: 1.5;\">Integrated sensors analyse and diagnose airborne pollutants in real time, displaying results on the LCD.<br><br></p><h3 class=\"text__heading h6\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; color: rgb(255, 255, 255);\">Captures gases and ultrafine particles</h3><div class=\"text__body js-text-body typography-body--small\" data-label-target=\"Opens in new Window\" style=\"box-sizing: inherit; margin-bottom: 0.5rem; line-height: 1.5;\"><p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: inherit; font-weight: inherit; font-size: inherit; line-height: 1.5;\">The HEPA H13 filter captures 99.97% of particles as small as 0.3 microns, while a layer of activated carbon removes odors and gases including VOCs.<br><br><br>Two phases of purification sit within our fully-sealed filtration system to trap pollutants inside, removing them from the air you breathe. So what goes inside, stays inside.<br><br><span style=\"color: rgb(85, 85, 85); background-color: rgb(255, 255, 255);\">The Dyson Purifier Cool Gen1 machine has the same core capabilities found in our purification products. The Dyson Purifer Cool Gen1 machine, senses pollutants PM2.5 and PM10. Although this machine doesnt have app connectivity, the remote control allows you to easily adjust settings on the machine.</span><br></p></div></div>', 329.99, 41.25, 288.74, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/FNgfbqmaorw5v2ZVQdE2.png', 1, 1, NULL, '2024-04-20 11:19:26', '2024-04-20 11:19:26');
