(94, 'Dyson Zone noise cancelling headphones (Prussian blue/Bright copper)', 'dyson-zone-noise-cancelling-headphones-prussian-blue-bright-copper-', NULL, '<p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: DysonFutura, sans-serif; line-height: 1.5; color: rgb(51, 51, 51);\">Pure Dyson audio with advanced noise cancellation</p><p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: DysonFutura, sans-serif; line-height: 1.5; color: rgb(51, 51, 51);\">Engineered for realistic detailed audio</p><p style=\"box-sizing: inherit; margin-bottom: 0px; font-family: DysonFutura, sans-serif; line-height: 1.5; color: rgb(51, 51, 51);\">Up to 50 hours with ANC</p>', '<h3 class=\"text__heading h6\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; color: rgb(255, 255, 255); background-color: rgb(0, 0, 0);\">Engineered for realistic, detailed audio</h3><div class=\"text__body js-text-body typography-body\" data-label-target=\"Opens in new Window\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; margin-bottom: 0.5rem; color: rgb(255, 255, 255); background-color: rgb(0, 0, 0);\"><p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: inherit; font-weight: inherit; font-size: inherit; line-height: 1.5;\">Intelligent signal processing combined with active noise cancellation reduces distortion  ensuring realistic, detailed audio.&nbsp;<br></p><h3 class=\"text__heading h6\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; color: rgb(255, 255, 255);\">Advanced noise cancelling</h3><div class=\"text__body js-text-body typography-body\" data-label-target=\"Opens in new Window\" style=\"box-sizing: inherit; font-size: 1.125rem; line-height: 1.5rem; margin-bottom: 0.5rem;\"><p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: inherit; font-weight: inherit; font-size: inherit; line-height: 1.5;\">Eight active noise-cancelling microphones monitor surrounding noise 384,000 times a second, cancelling background noise. With two additional microphones for telephony and transparency systems.<br></p><h3 class=\"text__heading h6\" style=\"box-sizing: inherit; font-family: DysonFutura, sans-serif; font-size: 1.125rem; line-height: 1.5rem; color: rgb(255, 255, 255);\">Full audio spectrum</h3><div class=\"text__body js-text-body typography-body\" data-label-target=\"Opens in new Window\" style=\"box-sizing: inherit; font-size: 1.125rem; line-height: 1.5rem; margin-bottom: 0.5rem;\"><p style=\"box-sizing: inherit; margin-bottom: 0.5rem; font-family: inherit; font-weight: inherit; font-size: inherit; line-height: 1.5;\">The custom-built 40mm, 16-ohm neodymium speaker driver delivers a broad frequency range for absolute clarity in bass, mids and highs.<br><br><br></p></div></div><h2 class=\"product-specification__heading col-xs-12\" style=\"box-sizing: inherit; margin-top: 3rem; margin-bottom: 1.5rem; font-family: DysonFutura, sans-serif; font-size: 2.25rem; line-height: 2.75rem; position: relative; min-height: 1px; padding-right: 16.5px; padding-left: 16.5px; float: left; width: 1296px; color: rgb(51, 51, 51); background-color: rgb(251, 251, 251);\">Specifications</h2><ul class=\"product-specification__specification-container\" role=\"list\" style=\"box-sizing: inherit; margin-bottom: 0.625rem; font-size: 16px; line-height: 1.5; clear: both; display: flex; flex-wrap: wrap; list-style-type: none; color: rgb(51, 51, 51); background-color: rgb(251, 251, 251);\"><li class=\"col-xs-12 col-md-6 col-lg-3 product-specification__column\" style=\"box-sizing: inherit; min-height: 1px; padding-right: 16.5px; padding-left: 16.5px; float: left; width: 324px; display: flex; flex-direction: column;\"><p class=\"product-specification__label-top\" style=\"box-sizing: inherit; margin-bottom: 0px; font-size: 1rem; line-height: 1.5rem; color: rgb(85, 85, 85