00;\">Accuracy: 30 seconds per month</div></div><div class=\"p-product_detail-spec-accordion__panel-item\" style=\"box-sizing: inherit; width: 348.672px; border-top: 1px solid rgb(190, 190, 190); padding-top: 15.375px; padding-bottom: 15.375px;\"><div class=\"p-product_detail-spec-accordion__panel-item-ttl\" style=\"box-sizing: inherit; white-space-collapse: break-spaces; font-size: 9pt; color: rgb(95, 95, 95); margin-bottom: 10px; display: flex; align-content: center;\"><h4 style=\"box-sizing: inherit; margin-bottom: 0px; line-height: 1.5;\">Other features</h4></div><div class=\"p-product_detail-spec-accordion__panel-item-cont\" style=\"box-sizing: inherit; white-space-collapse: break-spaces; font-size: 9pt; font-weight: 700;\">12/24-hour format</div><div class=\"p-product_detail-spec-accordion__panel-item-cont\" style=\"box-sizing: inherit; white-space-collapse: break-spaces; font-size: 9pt; font-weight: 700;\">Regular timekeeping:</div></div></div></div></div>', 29.95, 3.00, 26.95, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/1gbqJGmgjZUAOMtdiy4n.png', 1, 1, NULL, '2024-04-20 12:54:29', '2024-04-20 12:54:29'),
(107, 'Hogwart  Astronomy Tower', 'hogwart-astronomy-tower', NULL, '<p>Filled to the turrets with fun</p><p>The 971-piece set contains iconic rooms, popular characters, fun accessories and endless magical possibilities.</p>', '<p style=\"box-sizing: inherit; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">LEGO Harry Potter Hogwarts Astronomy Tower (75969) is filled to the turrets with iconic locations, cool characters and authentic detail from the Harry Potter movies.</p><p style=\"box-sizing: inherit; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Toy brick castle bursting with Harry Potter movie action<br style=\"box-sizing: inherit;\">This LEGO Hogwarts playset gives kids the freedom to explore the many fascinating rooms of a magical castle with Harry Potter, Hermione Granger, Horace Slughorn, Luna Lovegood, Neville Longbottom, Ron Weasley, Lavender Brown, Draco Malfoy and Hedwig. With so manyfamiliar places and popular characters, kids can relive scenes and stories from movies, including Harry Potter and the Half-Blood Prince, and conjure up endless adventures of their own.</p><p style=\"box-sizing: inherit; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Collectible toys, magical minifigures and non-stop action<br style=\"box-sizing: inherit;\">If you\'re looking for a top gift for a family member or best friend, LEGO Harry Potter toys offer endless imaginative fun for kids who love building and playing with LEGO bricks.</p><ul style=\"box-sizing: inherit; padding-left: 1.875rem; margin-top: 1.125rem; margin-bottom: 1.125rem; margin-left: 1.5625rem; list-style-position: outside; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\"><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Kids can role-play magical Hogwarts stories with favorite characters, iconic locations and realistic details when they enter the LEGO Harry Potter Hogwarts Astronomy Tower (75969).</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">This Hogwarts gift set includes many famous Harry Potter movie locations, 8 popular minifigures, a Hedwig toy and lots of authentic accessories, including mandrake plants, letters, wands and a book of potions.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Kids can be part of the magic when they visit the Potions master\'s classroom and attend his party, check out a mandrake in the greenhouse, explore Ravenclaw dormitory then head to the tallest tower for Astronomy class.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">With LEGO minifigures including Draco Malfoy and Neville Longbottom, this unique Harry Potter toy construction set is a cool gift for kids aged 9 and up.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">The model measures over 15 (40cm) high, 11 (29cm) wide and 6 (17cm) deep and connects seamlessly with LEGO Hogwarts sets 75953, 75954 and 75948 (limited availability for some sets).</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">No batteries needed. This hands-on Harry Potter building set provides endless imaginative fun fueled purely by childrens imaginations. And, when the action stops, the model looks awesome on display in any kids room.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Simple instructions get kids building and playing right away. As they explore the magical toy castle playset, young imaginations will be inspired to dream up endless imaginative role-play possibilities.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">LEGO Harry Potter building sets bring the excitement of the movies to life! With popular characters and creatures, cool locations and amazing features and accessories, they put Harry Potter magic into kids hands.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">LEGO building sets meet the highest industry standards, which means every brick is consistent, compatible and connects and pulls apart perfectly every time  no need for magic!  and it\'s been that way since 1958.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">LEGO bricks and pieces are dropped, heated, crushed, twisted and analyzed to ensure every building set meets the highest safety standards in the world. That\'s why they make great gifts for kids!</li></ul>', 99.99, 12.50, 87.49, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/wmyiZqtj1d6uCNTPXZ7v.png', 1, 1, NULL, '2024-04-20 13:04:51', '2024-04-20 13:04:51'),
(108, 'Shuri\'s Sunbird', 'shuri-s-sunbird', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: 18px;\">Sunbird features hinged wings that fold forwards and backwards and 2 big engines on ball joints that kids can tilt and rotate.</span><br></p>', '<h3 color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__Title-sc-18sd0hf-10 edTvzm\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 1.25rem; line-height: 1.9375rem; margin-bottom: 0.9375rem; text-align: center; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">Rotate the mega engines</span></h3><p color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__BodyText-sc-18sd0hf-11 fYGwjn\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 0.875rem; line-height: 1.1875rem; text-align: center; margin-bottom: 0px; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">The 2 engines have ball joints for maximum adjustability.<br><br></span></p><h3 color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__Title-sc-18sd0hf-10 edTvzm\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 1.25rem; line-height: 1.9375rem; margin-bottom: 0.9375rem; text-align: center; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">Fold back the wings</span></h3><p color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__BodyText-sc-18sd0hf-11 fYGwjn\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 0.875rem; line-height: 1.1875rem; text-align: center; margin-bottom: 0px; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\"></span></p><p color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__BodyText-sc-18sd0hf-11 fYGwjn\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 0.875rem; line-height: 1.1875rem; text-align: center; margin-bottom: 0px; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">The wings can fold away as Sunbird soars through the skies.<br></span></p><h3 color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__Title-sc-18sd0hf-10 edTvzm\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 1.25rem; line-height: 1.9375rem; margin-bottom: 0.9375rem; text-align: center; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">Go into battle</span></h3><p color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__BodyText-sc-18sd0hf-11 fYGwjn\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 0.875rem; line-height: 1.1875rem; text-align: center; margin-bottom: 0px; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\"></span></p><p color=\"black\" class=\"Text__BaseText-sc-13i1y3k-0 bwSfnv CardContentstyles__BodyText-sc-18sd0hf-11 fYGwjn\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 0.875rem; line-height: 1.1875rem; text-align: center; margin-bottom: 0px; width: 413.328px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">Blast the enemy with 2 front-mounted stud shooters.</span></p>', 29.99, 3.75, 26.24, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/ItLUD9u3HJYBdr1tfRQf.png', 1, 1, NULL, '2024-04-20 13:16:06', '2024-04-20 13:16:06'),
(109, 'Steam Train', 'steam-train', NULL, '<p><span style=\"color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\">The LEGO DUPLO 10874 Steam Train is now even easier for your toddler to control and interact with in multiple ways.&nbsp;</span><br></p>', '<p style=\"box-sizing: inherit; color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\">&nbsp;Young children can become the train driver with the Push &amp; Go motor  a gentle push either forwards or backwards sends the train on its way and a firm hold or lift off the tracks will make it stop. Help them place the 5 colored action bricks along the track to sound the horn, turn the lights on and off, pause and refuel, change direction and stop the train wherever they like. With a train station, coal tipper, 2 DUPLO figures plus an animal figure and a simple toy train track included in this LEGO DUPLO set, preschoolers can enjoy classic, fun train play. Download the optional app to unlock even more play possibilities, including remote-control function and fun activities to complete with your toddler!</p><p><br style=\"box-sizing: inherit; color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\"></p><ul style=\"box-sizing: inherit; padding-left: var(--ds-spacing-sm); margin: var(--ds-spacing-2xs) 0; color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\"><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Includes train driver and child LEGO DUPLO figures, plus a squirrel figure.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Features a buildable Push &amp; Go locomotive with lights and sounds, passenger carriage, 5 color-coded action bricks, train station, coal tipper, tree and 16 pieces of track.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Accessory elements include a refueling can, suitcase, bread and a spade.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Any toddler can start the steam train with a gentle push forwards or backwards, and stop it by placing their hand firmly on top of the engine.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Show your child how to place and move the 5 colored action bricks around the track so the train follows their instructions to sound the horn, turn on the lights, refuel, change direction or stop.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Develop imagination and early role-play skills using the LEGO DUPLO figures to create endless journeys and adventures.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Extend the play possibilities of this LEGO DUPLO set by downloading the free app with remote-control function and fun activities for young children to complete.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">The train and tracks included in this set are compatible with your childs existing LEGO DUPLO train collection.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Download the optional app at the App Store, Google Play Store or Amazon Kindle Store. Learn more at LEGO.com/devicecheck.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">LEGO DUPLO products are specially designed to be fun and easy for little hands.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">This product requires batteries (not included). Please refer to the product packaging for type and quantity.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Combine with the 10872 Train Bridge and Tracks, 10875 Cargo Train and 10882 Train Tracks for even more track combinations and LEGO DUPLO train fun.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Steam train with passenger car measures over 3 (10cm) high, 11 (30cm) long and 2 (7cm) wide.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Station measures over 5 (15cm) high, 4 (12cm) wide and 2 (6cm) deep.</li></ul>', 64.99, 8.12, 56.87, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/J5nvh6my0XC2CUNOMhxM.png', 1, 1, NULL, '2024-04-20 13:33:01', '2024-04-20 13:33:01'),
(110, 'Jake & Neytiris First Banshee Flight', 'jake-neytiri-s-first-banshee-flight', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: 18px;\">Fits into fans passions for thrills and adventure  they can act out film scenes or create their own Avatar tales.</span><br></p>', '<h2 data-test=\"hero-banner-title-text\" class=\"Text__BaseText-sc-13i1y3k-0 jfYWV HeroBannerstyles__TitleText-sc-22eq7p-7 bTdTEr\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 2.5rem; line-height: 3.125rem; margin-bottom: 0px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">A meaningful gift for fans and film-lovers</span></h2><p><span data-test=\"hero-banner-body-text\" class=\"Text__BaseText-sc-13i1y3k-0 gpWGjH HeroBannerstyles__BodyText-sc-22eq7p-8 iXddVz\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 1.125rem; line-height: 1.75rem; display: block; margin-top: 0.9375rem; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">This LEGO Avatar set is a fun holiday or birthday gift for fans of the film, adults and kids with a passion for action.</span></span></p>', 59.99, 7.50, 52.49, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/v3RWZL2tJuZRWf59omwW.png', 1, 1, NULL, '2024-04-20 13:40:55', '2024-04-20 13:42:41'),
(111, 'Hogwarts Astronomy Tower', 'hogwarts-astronomy-tower', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: 18px; text-align: right;\">There\'s a world of imaginative role-play for Harry Potter fans to explore inside this thrill-packed tower</span><br></p>', '<h2 data-test=\"hero-banner-title-text\" class=\"Text__BaseText-sc-13i1y3k-0 jfYWV HeroBannerstyles__TitleText-sc-22eq7p-7 bTdTEr\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 2.5rem; line-height: 3.125rem; margin-bottom: 0px; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">Filled to the turrets with fun</span></h2><p><span data-test=\"hero-banner-body-text\" class=\"Text__BaseText-sc-13i1y3k-0 gpWGjH HeroBannerstyles__BodyText-sc-22eq7p-8 iXddVz\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 1.125rem; line-height: 1.75rem; display: block; margin-top: 0.9375rem; font-family: &quot;Cera Pro&quot;, sans-serif;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">The 971-piece set contains iconic rooms, popular characters, fun accessories and endless magical possibilities.&nbsp;<br></span></span></p><h2 data-test=\"hero-banner-title-text\" class=\"Text__BaseText-sc-13i1y3k-0 jfYWV HeroBannerstyles__TitleText-sc-22eq7p-7 bTdTEr\" style=\"box-sizing: inherit; color: rgb(255, 255, 255); font-size: 2.5rem; line-height: 3.125rem; margin-bottom: 0px; font-family: &quot;Cera Pro&quot;, sans-serif; text-align: right;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">Build imaginations</span></h2><p><span data-test=\"hero-banner-body-text\" class=\"Text__BaseText-sc-13i1y3k-0 gpWGjH HeroBannerstyles__BodyText-sc-22eq7p-8 iXddVz\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-size: 1.125rem; line-height: 1.75rem; display: block; margin-top: 0.9375rem; font-family: &quot;Cera 