herit;\"><span data-test=\"hero-banner-body-text\" class=\"Text__BaseText-sc-13i1y3k-0 gpWGjH HeroBannerstyles__BodyText-sc-22eq7p-8 iXddVz\" style=\"box-sizing: inherit; color: rgb(255, 255, 255); font-size: 1.125rem; line-height: 1.75rem; display: block; margin-top: 0.9375rem; text-align: right;\"><span class=\"Markup__StyledMarkup-nc8x20-0 epIXnJ\" style=\"box-sizing: inherit;\">This versatile set puts open-ended play into kids\' hands, developing their skills and unlocking&nbsp;</span></span></span></span></p>', 99.99, 12.50, 87.49, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/tNm4yVkhUPwFcgEiO284.png', 1, 1, NULL, '2024-04-20 13:50:21', '2024-04-20 13:50:21'),
(112, 'The Force of Creativity', 'the-force-of-creativity', NULL, '<p><span style=\"color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Celebrate the 25th anniversary of LEGO&nbsp;</span><i style=\"box-sizing: inherit; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Star&nbsp;Wars</i><span style=\"color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\"> building sets with The Force of Creativity coffee-table book. The ultimate treat for yourself or a&nbsp;</span><i style=\"box-sizing: inherit; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Star&nbsp;Wars</i><span style=\"color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">&nbsp;gift for a fellow fan,&nbsp;</span><br></p>', '<p style=\"box-sizing: inherit; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">View previously unseen development art, character designs and more to gain an unparalleled insight into the creative process. This deluxe collectible book for adults is presented in a slipcase with an exclusive time capsule  a treasure trove of must-have LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i>&nbsp;memorabilia that includes art prints, facsimiles, new building instructions and a cardstock replica of the impossibly rare 1999 Toy Fair invitation box that marked the start of an epic adventure of 25 years and counting.</p><ul style=\"box-sizing: inherit; padding-left: 1.875rem; margin-top: 1.125rem; margin-bottom: 1.125rem; margin-left: 1.5625rem; list-style-position: outside; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\"><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Coffee-table book for LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i> fans  Celebrate 25 years of LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i>&nbsp;building sets with The Force of Creativity, a 312-page, hardcover illustrated book presented in a slipcase</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Collectible book for adults  Interviews with over 50 insiders at the LEGO Group and Lucasfilm, plus development art, character designs and more to reveal the story of the LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i> brand</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i> memorabilia  The time capsule in the slipcase features a development sketch for an early print ad (1999) and a postcard of an early version of the first LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i>&nbsp;logo</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Other time capsule items  A facsimile of a rare Toy Fair booklet (2010), development art for an unreleased LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i> Zam Wesell minifigure (2020), an unproduced animation script and more</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\"><i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i> gift for adult fans  Treat yourself or give this collectors edition book to another adult fan of LEGO&nbsp;<i style=\"box-sizing: inherit;\">Star&nbsp;Wars</i>&nbsp;building sets, real-world experiences and video games</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Measurements  The book measures over 11 in. (26 cm) long and 12 in. (31 cm) wide</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Reserve your copy  This book is available for pre-order from 1 May 2024 and is launching on 20 July 2024</li></ul>', 149.99, 18.75, 131.24, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/fNCV41C0aNbDeUS24KTW.png', 1, 1, NULL, '2024-04-20 14:19:14', '2024-04-20 14:19:14'),
(113, 'Andrea\'s Modern Mansion', 'andrea-s-modern-mansion', NULL, '<p><span style=\"color: rgb(255, 255, 255); font-family: &quot;Cera Pro&quot;, sans-serif; text-align: center; background-color: rgb(48, 30, 95);\">Andrea  one of the original LEGO Friends  is all grown up and hosting a party at her beautiful mansion.</span><br></p>', '<div>Andrea  one of the original LEGO Friends  is all grown up and hosting a party at her beautiful mansion. With a pool and hot tub, a working elevator, recording studio, yoga zone, karaoke and more, its the perfect place for Friends old and new to hang out. Join Andrea, Emma, Olivia, Mia and Stephanie  plus new friends Ji-Won, Leo, Autumn, Paisley and Imani for an epic party!</div><div>LEGO Friends Andrea\'s Modern Mansion</div>', 199.99, 25.00, 174.99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/DcESpHLo9I7Oys7ZUmCM.png', 1, 1, NULL, '2024-04-20 14:27:28', '2024-04-20 14:27:28'),
(114, 'Andrea\'s Modern Mansion', 'andrea-s-modern-mansion', NULL, '<p><span style=\"color: rgb(255, 255, 255); font-family: &quot;Cera Pro&quot;, sans-serif; text-align: center; background-color: rgb(48, 30, 95);\">Andrea  one of the original LEGO Friends  is all grown up and hosting a party at her beautiful mansion.</span><br></p>', '<div>Andrea  one of the original LEGO Friends  is all grown up and hosting a party at her beautiful mansion. With a pool and hot tub, a working elevator, recording studio, yoga zone, karaoke and more, its the perfect place for Friends old and new to hang out. Join Andrea, Emma, Olivia, Mia and Stephanie  plus new friends Ji-Won, Leo, Autumn, Paisley and Imani for an epic party!</div><div>LEGO Friends Andrea\'s Modern Mansion</div>', 199.99, 25.00, 174.99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/d1v3chJz8VfP22HRcINM.png', 1, 1, NULL, '2024-04-20 14:27:30', '2024-04-20 14:27:30'),
(115, 'NINJAGO Printed Basic Backpack', 'ninjago-printed-basic-backpack', NULL, '<p><span style=\"color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Send your little ninja to school with their belongings safely stored inside this stylish LEGO NINJAGO Printed Basic Backpack</span><br></p>', '<p><span style=\"color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\">Made from durable recycled polyester, it features a printed design of your kids favorite NINJAGO characters. It has a roomy capacity of 14 litres, and the zippered main compartment has an interior pocket to keep a notebook or small tablet computer safe. The backpack also has adjustable shoulder straps and front sternum straps to make it comfortable for kids to carry.</span></p><ul style=\"box-sizing: inherit; padding-left: 1.875rem; margin-top: 1.125rem; margin-bottom: 1.125rem; margin-left: 1.5625rem; list-style-position: outside; color: rgb(44, 44, 44); font-family: &quot;Cera Pro&quot;, sans-serif; font-size: medium;\"><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">LEGO NINJAGO Backpack  Features a printed design of your kids favourite ninja heroes, 14-liter capacity, a zippered main compartment with a slip pocket, plus a side mesh pocket for a water bottle</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">Made from recycled plastic bottles  10 recycled plastic bottles were used to produce the durable and eco-friendly polyester fabric that this LEGO NINJAGO Printed Basic Backpack is made from</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: 0.75rem; padding-bottom: 1.5625rem;\">A comfortable carry  Measuring over 16 in. (40 cm) high, 11 in. (27 cm) wide and 6 in. (15 cm) deep, this LEGO NINJAGO Backpack has adjustable shoulder straps with reflective strips</li></ul>', 49.99, 6.25, 43.74, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/AeC6xe3BPwDKY7JK6tGY.png', 1, 1, NULL, '2024-04-20 14:31:48', '2024-04-20 14:31:48');
