(116, 'LEGO Iconic Chess Set', 'lego-iconic-chess-set', NULL, '<p><span style=\"color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\">Use classic LEGO bricks to build your own chess board and then build all the playing pieces too.</span><br></p>', '<p style=\"box-sizing: inherit; color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\">This set is ideal to take and play wherever you like, as the pieces store conveniently inside the board. It can also be used to play checkers.</p><ul style=\"box-sizing: inherit; padding-left: var(--ds-spacing-sm); margin: var(--ds-spacing-2xs) 0; color: rgb(20, 20, 20); font-family: &quot;Cera Pro&quot;, sans-serif;\"><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Includes a buildable chessboard and buildable playing pieces.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Board opens to store all the playing pieces inside.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Can also be used to play checkers.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">This set includes over 1,400 pieces.</li><li style=\"box-sizing: inherit; list-style-type: disc; margin-bottom: var(--ds-spacing-4xs);\">Board measures over 10 (26cm) square.</li></ul>', 64.99, 8.12, 56.87, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/AEGOWnypvYNgFK8NtNp6.png', 1, 1, NULL, '2024-04-20 14:36:12', '2024-04-23 11:36:30'),
(117, 'MTPB145DC21V', 'mtpb145dc21v', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Immerse yourself in the 1980s  with a retro look and color scheme. </span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">The minimalist dial design makes for a pure fashion statement, and the time is so easy to read.</span><br></p><div class=\"text\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\"><div data-cmp-data-layer=\"{&quot;text-92c1d08128&quot;:{&quot;@type&quot;:&quot;casio/components/content/text&quot;,&quot;repo:modifyDate&quot;:&quot;2022-08-02T14:48:26Z&quot;,&quot;xdm:text&quot;:&quot;<p>*The color tone of the listed products may differ from the actual product in some cases.</p>\\n&quot;}}\" id=\"text-92c1d08128\" class=\"cmp-text\" style=\"box-sizing: inherit; font-size: 14px; line-height: 2;\"><p style=\"box-sizing: inherit; margin-bottom: 0px;\">The color tone of the listed products may differ from the actual product in some cases.</p></div></div><div class=\"container\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\"><div class=\"switch-container   \" data-magnifying-func=\"false\" style=\"box-sizing: inherit;\"><div id=\"at-reserved-01\" class=\"cmp-container\" style=\"box-sizing: inherit;\"><div class=\"embed\" style=\"box-sizing: inherit;\"><div id=\"embed-5ffca258b8\" class=\"cmp-embed\" style=\"box-sizin