3e23c\" class=\"cmp-text\" style=\"box-sizing: inherit; font-size: 14px; line-height: 2;\"><ul style=\"box-sizing: inherit; margin-bottom: 0px; margin-left: 1.5rem; padding-left: 1rem;\"><li style=\"box-sizing: inherit; list-style: none; position: relative;\"><a href=\"https://support.casio.com/en/support/faq.php?cid=009\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">FAQs (Frequently Asked Questions)</a></li><li style=\"box-sizing: inherit; list-style: none; position: relative;\"><a href=\"https://support.casio.com/en/manual/manual.php?cid=009\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">Manuals(Watches)</a></li><li style=\"box-sizing: inherit; list-style: none; position: relative;\"><a href=\"https://support.casio.com/en/support/information.php?cid=009&amp;pid=598\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">iOS / Android</a></li><li style=\"box-sizing: inherit; list-style: none; position: relative;\"><a href=\"https://support.casio.com/global/en/wat/video/\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">Video Tutorials</a></li><li style=\"box-sizing: inherit; list-style: none; position: relative;\"><a href=\"https://www.casio-intl.com/asia/en/support/gshock_warranties/\" target=\"_blank\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">G-SHOCK International Warranty Network</a></li></ul></div></div></div></div></div></div></div></div></div>', 94.95, 11.87, 83.08, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/1DmRhENIpHMaHPCej0k8.png', 1, 1, NULL, '2024-04-20 16:34:09', '2024-04-20 16:34:09'),
(118, 'DAS-100M', 'das-100m', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">It is useful when photographing lesions in locations that are difficult to focus on, such as between fingers or uneven lesions.</span><br></p>', '', 199.00, 24.88, 174.12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/JEbmMF947wF6Y9T37j5D.png', 1, 1, NULL, '2024-04-20 16:40:17', '2024-04-20 16:40:17'),
(119, 'BGD565-4', 'bgd565-4', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">The classic BABY-G square look you love  now in an even slimmer, more compact design.</span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">The classic BABY-G square look you love  now in an even slimmer, more compact design.\r\n\r\nThe smaller BGD-565 case is 2.6mm shorter, 2.1mm narrower, and 1.2mm slimmer than its predecessor and is designed to appear flat when viewed from the side for an even thinner look.\r\n\r\nIn versatile pink beige to match any fashion statement you choose, this watch is an ideal accessory any time of year.</span><br></p>', 89.00, 11.13, 77.87, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/arE52Z5K5AW5WsJP8GTx.png', 1, 1, NULL, '2024-04-20 16:45:47', '2024-04-20 16:45:47'),
(120, 'Beats Studio Buds +', 'beats-studio-buds-', NULL, '<h2 class=\"font-updated\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(22, 22, 22); font-weight: 700; line-height: 1.1; font-stretch: normal; overflow-wrap: break-word; word-break: break-word; font-size: clamp(2rem, 1.0769rem + 1.4423vw, 2.375rem); margin-block-start: 0.83em; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; margin-bottom: 0px; text-align: center; letter-spacing: -1px;\">Beats Studio&nbsp;Buds&nbsp;<span style=\"vertical-align: middle; font-size: 45.6px; margin-left: -3px; line-height: 0;\">+</span>&nbsp;True Wireless Noise Cancelling Earbuds</h2>', '<p id=\"footnote-**\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"background: 0px 0px; border: 0px none; margin-right: 5px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">**</span>Product may vary in color, details, and dimensions from 3D rendering. View on a device running the latest hardware and software for best results.</p><p id=\"footnote-1\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>1</span>As compared to Beats Studio Buds (1st generation).</p><p id=\"footnote-2\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>2</span>Testing conducted by Apple in March 2023 using preproduction Beats Studio Buds + and Charging Case units and software paired with iPhone 13 Pro and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency were turned off. Testing consisted of full Beats Studio Buds + battery discharge while playing audio until the first Beats Studio Buds + stopped playback. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-3\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>Compatible hardware and software required. Works with compatible content in supported apps. Not all content available in Dolby Atmos.</p><p id=\"footnote-4\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>4</span>Beats Studio&nbsp;Buds&nbsp;+ are sweat and water resistant for non-water sports and exercise. Beats Studio&nbsp;Buds&nbsp;+ were tested under controlled laboratory conditions, and have a rating of IPX4 under IEC standard 60529. Sweat and water resistance are not permanent conditions and resistance might decrease as a result of normal wear. Do not attempt to charge wet Beats Studio&nbsp;Buds&nbsp;+; refer to&nbsp;<a href=\"https://support.apple.com/en-us/HT209542\" target=\"_blank\" style=\"text-decoration-line: underline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; transition: color 0.35s ease-out 0s; color: rgb(117, 117, 117) !important;\">Apple Support</a>&nbsp;for cleaning and drying instructions. The charging case is not sweat or water resistant.</p><p id=\"footnote-5\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>5</span>One-touch pairing requires iOS 16.4 or later.</p><p id=\"footnote-6\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>6</span>Requires an iCloud account and a compatible Apple device running the latest operating system software or a compatible Android device running Android 8.0 or later, with Google Play Services enabled.</p><p id=\"footnote-7\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>7</span>Fast Pair requires location enabled. Full access to features requires an Android 6.0 or newer device with Google Play Service enabled and Google Account.</p><p id=\"footnote-8\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>8</span>Compatible with Android phones and tablets (Android 8+ with Google Play Services)</p><p id=\"footnote-9\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>9</span>Find My Device requires an Android device running Android 8.0 or later. User must be signed into an active Gmail account and have Google Play Services enabled.</p><p id=\"footnote-10\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>10</span>Testing conducted by Apple in March 2023 using preproduction Beats Studio Buds + and Charging Case units and software paired with iPhone 13 Pro units and pre-release software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation was turned on. Testing consisted of full Beats Studio Buds + battery discharge while playing audio until the first Beats Studio Buds + stopped playback. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-11\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>11</span>Testing conducted by Apple in March 2023 using preproduction Beats Studio&nbsp;Buds&nbsp;+ and Charging Case units and software paired with iPhone 13/iPhone 14 units and pre-release software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency were turned off. 5-minute charge testing conducted with drained Beats Studio&nbsp;Buds&nbsp;+ that were charged for 5 minutes, then audio playback was started until the first Beats Studio&nbsp;Buds&nbsp;+ stopped playback. Listening time depends on device settings, environment, usage and many other factors.</p><p id=\"footnote-12\" style=\"margin-bottom: 1em; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>12</span>Breakdown of U.S. retail packaging by weight. Adhesives, inks, and coatings are excluded from our calculations of plastic content and packaging weight.</p><p id=\"footnote-13\" style=\"margin-bottom: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px; color: rgb(117, 117, 117) !important;\"><span style=\"background: 0px 0px; border: 0px none; margin-right: 5px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>*</span>New subscribers only. Offer available for a limited time to new subscribers who connect an eligible device to an Apple device running iOS 15 or iPadOS 15 or later. Offer good for 6 months after eligible device pairing. No audio product purchase necessary for current owners of eligible devices. Plan automatically renews at your regions price per month until cancelled. Restrictions and&nbsp;<a href=\"https://www.apple.com/promo\" target=\"_blank\" style=\"text-decoration-line: underline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; transition: color 0.35s ease-out 0s; color: rgb(117, 117, 117) !important;\">other terms</a>&nbsp;apply.</p>', 169.99, 21.25, 148.74, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/ZMYm9ubMVaxgj0Iy8ryj.png', 1, 1, NULL, '2024-04-20 16:59:09', '2024-04-20 16:59:09'),
(121, 'Beats Fit Pro', 'beats-fit-pro', NULL, '<p><div class=\"product-main__content\" style=\"box-sizing: border-box; background: 0px 0px rgb(255, 255, 255); border: 0px none; margin: 0px; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; grid-area: 2 / 2; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"product-detail\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px; padding: 0px 1.5rem; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><div class=\"product-detail__price\" data-dynamic-price=\"\" data-id=\"MK2F3LL/A\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px 0px 1rem; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"></div></div></div></p><div class=\"product-main__head\" style=\"box-sizing: border-box; background: 0px 0px rgb(255, 255, 255); border: 0px none; margin: 0px; padding: 0px 1.5rem; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; grid-area: 1 / 2; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"product-detail__description\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px 0px 2rem; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 20px; line-height: 1.2em; letter-spacing: -1px;\"><p style=\"box-sizing: border-box; margin: 0px; padding: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">True Wireless Noise Cancelling Earbuds</p></div></div>', '<p id=\"footnote-1\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\">1</span>&nbsp;Compatible hardware and software required. Works with compatible content in supported apps. Not all content available in Dolby Atmos. Head tracking feature requires iPhone or iPad.</p><p id=\"footnote-2\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>2</span>&nbsp;Beats Fit Pro is sweat and water resistant for non-water sports and exercise. Beats Fit Pro was tested under controlled laboratory conditions, and have a rating of IPX4 under IEC standard 60529. Sweat and water resistance are not permanent conditions and resistance might decrease as a result of normal wear. Do not attempt to charge wet Beats Fit Pro; refer to https://support.apple.com/en-us/HT209542 for cleaning and drying instructions. The charging case is not sweat or water resistant.</p><p id=\"footnote-3\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Requires an iCloud account and macOS Sierra, iOS 10, watchOS 3 or later versions.</p><p id=\"footnote-4\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>4</span>&nbsp;Automatic Switching requires macOS 11.1, iOS 14.3, iPadOS 14.3, watchOS 7.2, or tvOS 14.3 or later.</p><p id=\"footnote-5\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>5</span>&nbsp;Audio Sharing is compatible with Beats Fit Pro, Beats Flex, Solo Pro, Powerbeats Pro, Powerbeats, Solo<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Wireless, Powerbeats<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Wireless, Beats Studio<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\">3</span>&nbsp;Wireless, Beats<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>X</span>, AirPods (1st generation or later), AirPods Pro, and AirPods Max. Works with iPhone 8 or later and iPod touch (7th generation) with the latest version of iOS; and 12.9-inch iPad Pro (2nd generation or later), 11-inch iPad Pro, 10.5-inch iPad Pro, iPad (5th generation or later), iPad Air (3rd generation), and iPad mini (5th generation) with the latest version of iPadOS.</p><p id=\"footnote-6\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>6</span>&nbsp;Siri may not be available in all languages or in all areas, and features may vary by area. Internet access is required. Cellular data charges may apply.</p><p id=\"footnote-7\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>7</span>&nbsp;Requires iCloud account and iOS 15.1, macOS Monterey 12.0.1, watchOS 8.1 or later versions. Siri may not be available in all languages or in all areas, and features may vary by area. Internet access is required. Cellular data charges may apply.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>8</span>&nbsp;Beats app requires Android 8.0 or later. App is available on the Google Play Store and on beatsbydre.com.</p><p id=\"footnote-9\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>9</span>&nbsp;Ear tip fit test requires iOS 15.1 or later, or the Beats app for Android.</p><p id=\"footnote-10\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>10</span>&nbsp;Testing conducted by Apple in September 2021 using preproduction Beats Fit Pro and Charging Case units and software paired with iPhone 12 units and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency were turned on. Testing consisted of full Beats Fit Pro battery discharge while playing audio until the first Beats Fit Pro stopped playback. With Active Noise Cancellation turned off, listening time was up to 7 hours. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-11\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>11</span>&nbsp;Testing conducted by Apple in September 2021 using preproduction Beats Fit Pro and Charging Case and software paired with iPhone 12 units and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency were turned on. Testing consisted of full Beats Fit Pro battery discharge while playing audio until the first Beats Fit Pro stopped playback. The drained Beats Fit Pro was charged to 100 percent, then audio playback was resumed until the first Beats Fit Pro stopped playback. This cycle was repeated until both the Beats Fit Pro and charging case were fully discharged. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-12\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>12</span>&nbsp;Testing conducted by Apple in September 2021 using preproduction Beats Fit Pro and Charging Case and software paired with iPhone 12 units and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency was turned on. 5-Minute charge testing conducted with drained Beats Fit Pro that were charged for 5 minutes, then audio playback was started until the first Beats Fit Pro stopped playback. Battery life depends on device settings, environment, usage, and many other factors.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\">*&nbsp;New subscribers only. Offer available for a limited time to new subscribers who connect an eligible device to an Apple device running iOS 15 or iPadOS 15 or later. Offer good for 6 months after eligible device pairing. No audio product purchase necessary for current owners of eligible devices. Plan automatically renews at your regions price per month until cancelled. Restrictions and&nbsp;<a href=\"https://www.apple.com/promo\" target=\"_blank\" style=\"color: inherit; text-decoration-line: underline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; transition: color 0.35s ease-out 0s;\">other terms</a>&nbsp;apply.</p>', 199.99, 25.00, 174.99, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,