(122, 'Beats Flex', 'beats-flex', NULL, '<p><div class=\"product-main__content\" style=\"box-sizing: border-box; background: 0px 0px rgb(255, 255, 255); border: 0px none; margin: 0px; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; grid-area: 2 / 2; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"product-detail\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px; padding: 0px 1.5rem; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><div class=\"product-detail__price\" data-dynamic-price=\"\" data-id=\"MYMG2LL/A\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px 0px 1rem; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"></div></div></div></p><div class=\"product-main__head\" style=\"box-sizing: border-box; background: 0px 0px rgb(255, 255, 255); border: 0px none; margin: 0px; padding: 0px 1.5rem; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; grid-area: 1 / 2; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"product-detail__description\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px 0px 2rem; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 20px; line-height: 1.2em; letter-spacing: -1px;\"><p style=\"box-sizing: border-box; margin: 0px; padding: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">All-Day Wireless Earbuds</p></div></div>', '<p id=\"footnote-1\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\">1</span>&nbsp;Compatible with iOS and iPadOS 14 or later, MacOS 11 or later, WatchOS 7 or later, and tvOS 14 or later; compatibility will vary on Android devices.</p><p id=\"footnote-2\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>2</span>&nbsp;Audio Sharing is compatible with Beats Flex, Solo Pro, Powerbeats Pro, Powerbeats, Solo<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Wireless, Powerbeats<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\">3</span>&nbsp;Wireless, Beats Studio<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Wireless, Beats<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>X</span>, AirPods (1st generation or later), and AirPods Pro. Works with iPhone 8 or later and iPod touch (7th generation) with the latest version of iOS; and 12.9-inch iPad Pro (2nd generation or later), 11-inch iPad Pro, 10.5-inch iPad Pro, iPad (5th generation or later), iPad Air (3rd generation), and iPad mini (5th generation) with the latest version of iPadOS.</p><p id=\"footnote-3\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Testing conducted by Apple in August 2020 using preproduction Beats Flex and software paired with iPhone 11 Pro Max units and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50%. Total listening time was up to 12 hours. Testing consisted of full Beats Flex battery discharge while playing audio until Beats Flex stopped playback. 10-Minute charge testing conducted with drained Beats Flex that were charged for 10 minutes, then audio playback was started until Beats Flex stopped playback. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-4\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>4</span>&nbsp;Requires iCloud account and macOS Sierra, iOS 10, watchOS 3 or later versions.</p><p id=\"footnote-5\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>5</span>&nbsp;Find My Beats requires an iPhone or iPod touch with iOS 14.5 or later, iPad with iPadOS 14.5 or later, or Mac with macOS Big Sur 11.3 or later. Customers must have an Apple ID and be signed into their iCloud account with Find My enabled.</p><p id=\"footnote-6\" class=\"pdp-sml-body\" style=\"margin-bottom: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>6</span>&nbsp;Find My can locate headphones and play a sound within the Bluetooth range of an iOS device signed in to iCloud.</p>', 69.99, 8.75, 61.23, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/LyQjuXQDmOC639zJkO2Y.png', 1, 1, NULL, '2024-04-20 17:12:29', '2024-04-20 17:12:29'),
(123, 'Powerbeats Pro', 'powerbeats-pro', NULL, '<p><div class=\"product-main__content\" style=\"box-sizing: border-box; background: 0px 0px rgb(255, 255, 255); border: 0px none; margin: 0px; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; grid-area: 2 / 2; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"product-detail\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px; padding: 0px 1.5rem; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><div class=\"product-detail__price\" data-dynamic-price=\"\" data-id=\"MY582LL/A\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px 0px 1rem; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"></div></div></div></p><div class=\"product-main__head\" style=\"box-sizing: border-box; background: 0px 0px rgb(255, 255, 255); border: 0px none; margin: 0px; padding: 0px 1.5rem; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; grid-area: 1 / 2; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"product-detail__description\" style=\"box-sizing: border-box; background: 0px 0px; border: 0px none; margin: 0px 0px 2rem; padding: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 20px; line-height: 1.2em; letter-spacing: -1px;\"><p style=\"box-sizing: border-box; margin: 0px; padding: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">True Wireless High-Performance Earbuds</p></div></div>', '<p id=\"footnote-1\" class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; color: gray; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\">1</span>&nbsp;Compatible hardware and software required. Works with compatible content in supported apps. Not all content available in Dolby Atmos.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>2</span>&nbsp;Powerbeats Pro are sweat and water resistant for non-water sports and exercise. Powerbeats Pro were tested under controlled laboratory conditions, and have a rating of IPX4 under IEC standard 60529. Sweat and water resistance are not permanent conditions and resistance might decrease as a result of normal wear. Do not attempt to charge wet Powerbeats Pro; refer to https://support.apple.com/en-us/HT209542 for cleaning and drying instructions. The charging case is not sweat or water resistant.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>&nbsp;Battery life depends on device settings, environment, usage, and many other factors</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>4</span>&nbsp;Testing conducted by Apple in March 2019 using preproduction Powerbeats Pro and Charging Case units and software paired with iPhone XS units and prerelease software. The playlist consisted of continuous pink noise at 80dB. 5-Minute charge testing conducted with drained Powerbeats Pro that were charged for 5 minutes, then audio playback was started until the first Powerbeats Pro stopped playback. Battery life depends on device setting, environment, usage, and many other factors.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>5</span>&nbsp;Testing conducted by Apple in March 2019 using preproduction Powerbeats Pro units and Powerbeats3 Wireless units and software paired with iPhone XS units and prerelease software. Testing consisted of transferring phone call audio from iPhone to Powerbeats Pro and Powerbeats3 Wireless. Performance depends on device settings, environment, and many factors.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>6</span>&nbsp;Audio Sharing is compatible with Beats Fit Pro, Beats Flex, Solo Pro, Powerbeats Pro, Powerbeats, Solo3 Wireless, Powerbeats3 Wireless, Beats Studio3 Wireless, BeatsX, AirPods (1st generation or later), AirPods Pro, and AirPods Max. Works with iPhone 8 or later and iPod touch (7th generation) with the latest version of iOS; and 12.9-inch iPad Pro (2nd generation or later), 11-inch iPad Pro, 10.5-inch iPad Pro, iPad (5th generation or later), iPad Air (3rd generation), and iPad mini (5th generation) with the latest version of iPadOS.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>7</span>&nbsp;Find My for Powerbeats Pro requires an iPhone or iPod touch with iOS 14.5 or later, iPad with iPadOS 14.5 or later, or Mac with macOS Big Sur 11.3 or later. Customers must have an Apple ID and be signed into their iCloud account with Find My enabled.</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>8</span>&nbsp;Siri may not be available in all languages or in all areas, and features may vary by area. Internet access is required. Cellular data charges may apply</p><p class=\"pdp-sml-body\" style=\"margin-bottom: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: gray;\">*&nbsp;New subscribers only. Offer available for a limited time to new subscribers who connect an eligible device to an Apple device running iOS 15 or iPadOS 15 or later. Offer good for 6 months after eligible device pairing. No audio product purchase necessary for current owners of eligible devices. Plan automatically renews at your regions price per month until cancelled. Restrictions and&nbsp;<a href=\"https://www.apple.com/promo\" target=\"_blank\" style=\"color: inherit; text-decoration-line: underline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; transition: color 0.35s ease-out 0s;\">other terms</a>&nbsp;apply.</p>', 249.95, 31.24, 218.71, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/zTufINmHCRtVhRTKqeWS.png', 1, 1, NULL, '2024-04-20 17:17:08', '2024-04-20 17:17:08'),
(124, 'Beats Studio Pro', 'beats-studio-pro', NULL, '<span style=\"color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 28px; letter-spacing: -0.2px; background-color: rgb(250, 250, 250);\">Redeem your 6-month offer to start listening to over 100 million songs, ad-free. And enjoy a truly immersive experience with spatial audio featuring Dolby Atmos.</span><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; letter-spacing: -0.2px; background-color: rgb(250, 250, 250);\"></span><br><div><span style=\"color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 28px; letter-spacing: -0.2px; background-color: rgb(250, 250, 250);\"><br></span></div>', '<div class=\"beatsRTE parbase section\" style=\"background-position: 0px 0px; background-color: rgb(255, 255, 255); border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><section class=\"bbd-component bbd-rte-container observed\" data-analytics-module=\"rte\" data-analytics-region=\"footnotes\" data-analytics-scroll=\"\"><div class=\"rte-container-7121ed71-e292-35b8-a018-62886c768478 component-section-spacing beatsRTE\" style=\"background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><div class=\"font-updated pdp-sml-body\" style=\"background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; font-size: 0.75rem; line-height: 1.5; font-family: var(--font-primary); color: rgb(153, 153, 153);\"><p id=\"footnote-**\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\">Product may vary in color, details, and dimensions from 3D rendering. View on a device running the latest hardware and software for best results.</p><p id=\"footnote-1\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>1</span>Testing conducted by Apple in May 2023 using preproduction Beats Studio Pro units and software paired with iPhone 13 units and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency were turned off. Testing consisted of full Beats Studio Pro battery discharge while playing audio until Beats Studio Pro stopped playback. With Active Noise Cancellation turned on, listening time was up to 24 hours. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-2\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>2</span>While using included USB-C cable with a compatible USB-enabled source device. Requires compatible lossless content from supported apps/services. Not all content is available in lossless format.</p><p id=\"footnote-3\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>3</span>Compatible hardware and software required. Works with compatible content in supported apps. Not all content available in Dolby Atmos. iPhone with TrueDepth camera required to create a personal profile for Spatial Audio, which will sync across Apple devices running the latest operating system software, including iOS, iPadOS, macOS, and tvOS.</p><p id=\"footnote-4\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>4</span>Requires an iCloud account and a compatible Apple device running the latest operating system software or a compatible Android device running Android 8.0 or later, with Google Play Services enabled.</p><p id=\"footnote-5\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>5</span>Requires an iCloud account and a compatible Apple device running the latest operating system software.</p><p id=\"footnote-6\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>6</span>Siri may not be available in all languages or in all areas, and features may vary by area. Internet access is required. Cellular data charges may apply.</p><p id=\"footnote-7\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>7</span>Find My requires an iPhone or iPod touch with iOS 16.5 or later, iPad with iPadOS 16.5 or later, or Mac with macOS Ventura 13.4 or later. Customers must have an Apple ID and be signed into their iCloud account with Find My enabled.</p><p id=\"footnote-8\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>8</span>Google Fast Pair requires a compatible Android device running Android 8.0 or later, with Google Play Services enabled.</p><p id=\"footnote-9\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>9</span>Audio Switch feature requires compatible Android devices running Android 8.0 or later, with Google Play Services enabled.</p><p id=\"footnote-10\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>10</span>Find My Device requires an Android device running Android 8.0 or later. User must be signed into an active Gmail account and have Google Play Services enabled.</p><p id=\"footnote-11\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>11</span>Testing conducted by Apple in May 2023 using preproduction Beats Studio Pro units and software paired with iPhone 13 units and prerelease software. The playlist consisted of 358 unique audio tracks purchased from the iTunes Store (256-Kbps AAC encoding). Volume was set to 50% and Active Noise Cancellation and Transparency were turned off. 10-Minute charge testing conducted with drained Beats Studio Pro that were charged for 10 minutes, then audio playback was started until Beats Studio Pro stopped playback. Battery life depends on device settings, environment, usage, and many other factors.</p><p id=\"footnote-12\" style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>12</span>Breakdown of U.S. retail packaging by weight. Adhesives, inks, and coatings are excluded from our calculations of plastic content and packaging weight.</p><p id=\"footnote-13\" style=\"margin-bottom: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(117, 117, 117) !important;\"><span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative; margin-right: 5px;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>*</span>New subscribers only. Offer available for a limited time to new subscribers who connect an eligible device to an Apple device running iOS 15 or iPadOS 15 or later. Offer good for 6 months after eligible device pairing. No audio product purchase necessary for current owners of eligible devices. Plan automatically renews at your regions price per month until cancelled. Restrictions and&nbsp;<a href=\"https://www.apple.com/promo\" target=\"_blank\" style=\"text-decoration-line: underline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; transition: color 0.35s ease-out 0s; color: rgb(117, 117, 117) !important;\">other terms</a>&nbsp;apply.</p></div></div></section></div><div class=\"genericSpacing parbase section\" style=\"background-position: 0px 0px; background-color: rgb(255, 255, 255); border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; width: 1320px; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"></div>', 349.99, 52.50, 297.49, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/SkUOz7551sO4Gs7kI7V8.png', 1, 1, NULL, '2024-04-20 17:23:06', '2024-04-20 17:23:06'),
(125, 'BenQ GW2480 24 Inch FHD 1080p Eye-Care LED Monitor', 'benq-gw2480-24-inch-fhd-1080p-eye-care-led-monitor', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Outdoor Portable 4K Support Projector 15000L HD 1080P Max 300\" Display Zoom, FUDONI Movie Video Home Theater Projector Compatible with HDMI/USB/Phone/Laptop/TV Stick</span></h1>', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding-bottom: 4px; margin-bottom: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><h1 class=\"a-size-base-plus a-text-bold\" style=\"padding-bottom: 4px; margin-bottom: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\"><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px; font-weight: 400;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">HIGH-QUALITY SOUND PROJECTORBuilt-in dual HiFi speakers for great stereo surround, this home theater projector with speaker is the best choice for indoor and outdoor use. More important, the FUDONI Bluetooth projector with 5.1 Bluetooth allows you to easily connect your ideal soundbar, headphone, or other audio equipment.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">CONVENIENT CONNECTION PROJECTORThe FUDONI projector with WiFi Bluetooth supports screen mirroring for iOS, Android, and Windows devices without extra adapters or apps. Ultra-fast 5G WiFi offers you a more stable connection and lag-free online streaming experience for video streaming and gaming online. With USB, HDMI, AV, and Audio ports, this portable projector allows you to use it with USB, TV Stick, phone, PC, BT Speaker, DVD player, PS5, and Game Consoles.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">CLEAR and BRIGHT IMAGE PROJECTORWith a 1920 x 1080 resolution, this outdoor native 1080P projector can display more explicit images and supports 4K video playback. This daytime projector with high lumens can improve the resistance to ambient light and offers a brighter image. This movie projector with a 10000:1 contrast ratio has great color accuracy, allows for more realistic color reproduction, and highlights darker details.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">MAX 300\" LARGE DISPLAY PROJECTOR The movie projector displays a 41- 300 \" projection size at a 5-34ft projection distance, the max 300\" image size offers you an immersive and cinematic visual experience. Equipped with a 100-50% zoom function, you can get the best viewing size by manual adjustment. This mini portable projector has more features like sleep mode and rear projection, providing various entertainment for your family and friends.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">PORTABLE PROJECTOR CASE PROJECTORThis portable projector also comes with a scratch-resistant case, can be easily carried everywhere and used while camping, RV travelling, outdoor party and business meetings etc. This movie projector 4K can be mounted on a tripod stand, table or ceiling, support rear projection.</span></li></ul></h1>', 229.99, 34.50, 195.49, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/K3UgXsqPFpGZwrSEB3mC.png', 1, 1, NULL, '2024-04-20 17:35:25', '2024-04-22 15:40:56'),
(126, 'Electric-Focus] 5G WiFi Bluetooth Projector', 'electric-focus-5g-wifi-bluetooth-projector', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">&nbsp;TOPTRO TR23 Mini Projector Support 1080P, 15000 Lumen, 4D/4P Keystone&amp; Zoom, Latest Dust-Proof Portable Projector, Outdoor Projector for iOS/Android/PS5</span></h1>', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding-bottom: 4px; margin-bottom: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">15000 Lumens &amp; Supports Full HD 1080P TOPTRO 2024 upgraded version TR23 projector supports 15000 Lumens, 1920 x 1080 resolution, 20000:1 contrast ratio, providing you with vivid, saturated images with outstanding clarity. This projector support 100%-50% zoom, allows you to get the right screen size without frequently adjusting the distance, especially when it is suspended from the ceiling. TR23 portable projector will create the perfect personal home theater for you and your family.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Electric-Focus &amp; 4D/4P CorrectionIn order to meet customer needs, the TR23 mini projector has been upgraded with electric focus, just press and hold the focus button to quickly focus the screen to capture a sharp image. Compared with other home projectors, it is more convenient and faster to focus. The 4D/4P correction function allows you to easily adjust all four points and all 4 sides on the projection screen through the remote control, you can adjust the image to a rectangle easily.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Fully Sealed Optical Machine DesignThe TR23 bluetooth projector uses unique craftsmanship to make every detail exude exquisite charm. It breaks the traditional appearance and makes it both fashionable and portable. Adopting a fully sealed optical system that prevents dust pollution on optical components (IP5X certification), Say goodbye to screen yellowing, black dots, and light leakage issues. And the noise is greatly reduced, allowing you to enjoy an immersive home theater experience.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Ultra-fast 5G/2.4G WiFi &amp; 5.2 BluetoothThis WiFi projector is equipped with an advanced 5G WiFi chip, which can effectively avoid signal interference. This makes the transmission more stable and faster preventing lag and freezing of the screen during playback. Also, this mini projector includes two built-in speaker and supports the 5.2 Bluetooth function, which allows connection with Bluetooth headsets, Bluetooth speakers, Sound bars, and AirPods without hassle.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">Shocking Stereo Sound &amp; Professional After-SalesAfter 5 years of polishing the sound design technology, the customized super large sound cavity has created the TR23 projector\'s 360-degree stereo surround sound quality. Strong heat dissipation, more stable performance and longer use. TOPTRO provides 1-year money-back guarantee and 3-Year repair, lifetime professional technical support. Any problems, please let us know.</span></li></ul>', 105.99, 15.90, 90.08, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/sjYk4JXbhqvh29RXDh3I.png', 1, 1, NULL, '2024-04-20 17:42:58', '2024-04-20 17:42:58');
