(127, 'BenQ GS50 1080p Wireless Outdoor Projector', 'benq-gs50-1080p-wireless-outdoor-projector', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Extra Bass Bluetooth Speaker | IPX2 Splash &amp; Drop Resistant | WiFi | Android TV | Chromecast &amp; AirPlay | Auto Focus | 2D Keystone | HDMI | USB-C | PD 45W</span></h1>', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding-bottom: 4px; margin-bottom: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">BIG &amp; CLEAR CINEMATIC PICTURE: 1080p Full HD Resolution, 500 ANSI Lumens with HDR10/HLG showcase brilliant details.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">2.1 CHANNEL AUDIO W/EXTRA BASS: 2.1 Channel Bluetooth Speaker with Extra Bass (5Wx2 midrange tweeters &amp; 10W woofer).</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">OPTIMAL PICTURE MODES: Optimized Picture Modes powered by CinematicColor and 98% Rec.709 wide color gamut for true color.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">EASY SETUP &amp; VERSATILE PROJECTION: Adjustable stand tilts up to 15, auto focus, 2D keystone &amp; four corner adjustment.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">WIRELESS &amp; DIVERSE ENTERTAINMENT: Embedded Google-certified Android TV, supports AirPlay &amp; Chromecast casting for iOS, MacOS, Android, and PC devices.</span></li></ul>', 699.00, 104.85, 594.15, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/qL28U0jfxl53PSghSYls.png', 1, 1, NULL, '2024-04-20 17:48:32', '2024-04-22 13:12:40'),
(128, 'BenQ MindDuo 2 Kids Study Lamp (White)', 'benq-mindduo-2-kids-study-lamp-white-', NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; margin-bottom: 0px !important; font-size: 24px !important; line-height: 32px !important;\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\" style=\"text-rendering: optimizelegibility; word-break: break-word; line-height: 32px !important;\">Wide &amp; Even Illumination, Auto Dimming, Brightness &amp; Color Adjustment, Presence Detection</span></h1>', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding-bottom: 4px; margin-bottom: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">ADVANCED ILLUMINATION - Utilizing OVAL-Light optical technologies, the MindDuo 2 provides wide, even, and ample lighting, covering an area of up to 37.4 inches with a light level of 500 lux. The Glare-CUT design further ensures the absence of direct glare, thereby reducing eye strain during extended study sessions.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">CUSTOMIZABLE SETTINGS - Offers a range of adjustable features, including seven color temperature choices ranging from 2700K to 5700K, brightness adjustments, height, and angles. These customizable settings enable personalized adjustments for an optimal study environment.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">ENHANCED FUNCTIONALITY - Incorporates two smart dimming modes for versatile lighting options. The Paper-Reading Mode delivers warm white light (5700K), adjusting to surrounding conditions, while the Screen-Reading Mode utilizes ZONA-Light technology, minimizing screen glare and providing a comfortable 4000K color temperature and suitable brightness.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">FLICKER-FREE &amp; BLUE-LIGHT-FREE - The built-in driver chip ensures a flicker-free experience with the MindDuo 2. Its LED light sources are certified as RG0 (Risk Group 0), completely free from blue light hazards, ensuring a safe and comfortable studying experience for children.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word;\"><span class=\"a-list-item\">THOUGHTFUL DESIGNS FOR CHILDREN - The front-facing user interface enables easy operation for children. Additionally, it includes a 30-minute break reminder to promote healthy study habits and presence detection for automatic on/off functionality.</span></li></ul>', 269.00, 40.35, 228.65, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/pdxCzJq4xhvyodKK9yA8.png', 1, 1, NULL, '2024-04-20 17:52:48', '2024-04-22 14:35:46'),
