(138, 'A158WA-1', 'a158wa-1', NULL, '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 18px;\">Vintage</span><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Look no further if you are looking for a silver toned watch that can be both durable and stylish, the CASIO A158WA-1 might just be what you\'re looking for.\r\n\r\nThe A158WA-1 is a silver toned digital watch that encompasses everything you need. With a stainless steel band and a stainless steel watch face that is aglow with individuality and looks great on the street fashion scene. So add this silver toned watch to your G-Shock collection or simply make it your next everyday watch. After all, this CASIO digital watch is made to be both highly durable and functional! \r\n\r\nThe A158WA-1 silver toned digital watch includes features like hands and hour markers with large fluorescent areas for easy reading and a reliable screw-lock crown. This men\'s digital watch also has a battery life of 3 years on CR2016. With its long battery life and reliable performance, this CASIO men\'s digital watch is perfect for those who want a stylish yet multifunctional watch.</span><br></p>', 22.95, 2.29, 20.66, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/ZVCDscVhOIpMN7oTMCTn.png', 1, 1, NULL, '2024-04-23 13:16:38', '2024-04-23 13:16:38'),
(139, 'fx-991CW ClassWiz Advanced Scientific', 'fx-991cw-classwiz-advanced-scientific', NULL, '<p><div class=\"p-product_detail-hdg-lv1\" style=\"box-sizing: inherit; word-break: keep-all; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; font-weight: 200; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Standard Scientific Calculators</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\">The fx-991CW ClassWiz is the latest enhancement to the scientific calculator. With an all-new quadruple graded LCD display, users will be able to easily find their cursor while writing and modifying expressions. The ClassWiz features circular, convex buttons that are appropriately spaced to prevent the mis-keying of information, and the button labels now feature glyphic representations of the functions they perform. The hard plastic case features an etched edge surface to prevent slipping in the hand. The ClassWiz can store and recall up to nine variables which can contain integers, computations, and functions. The variables will persist in the calculator\'s memory between sessions. All of the calculator\'s functions can be accessed through the convenient Math Catalog. The Math Catalog also hosts 47 scientific constants and 40 measurement conversions. By partnering the ClassWiz with an internet-capable mobile device, solutions can be graphed and visualized through ClassPad.net by scanning a QR code on the calculator\'s screen.</span><br></p>', 22.99, 2.30, 20.68, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/nNmkx0yjwushRumAoJ8n.png', 1, 1, NULL, '2024-04-23 13:20:13', '2024-04-23 13:20:13');
