(140, 'fx-CG50 PRIZM Color Grapher', 'fx-cg50-prizm-color-grapher', NULL, '<p><div class=\"p-product_detail-hdg-lv1\" style=\"box-sizing: inherit; word-break: keep-all; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; font-weight: 200; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Graphing Calculators</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\">With the advanced features of a next-generation graphing calculator, the fx-CG50 PRIZM will support students and educators through middle school, high school, and into college. With Natural Textbook Display and an intuitive icon menu, students will find the calculator incredibly easy to use. Its 3D graphing and improved catalog functions allow for greater engagement and real-life application in the mathematics classroom.</span><br style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\"><br style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\"><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px;\">This model is approved for the SAT, PSAT, ACT, and AP tests, and includes Exam Mode to lock specific functionality for testing purposes. The fx-CG50 does not feature a C.A.S.</span><br></p>', 110.99, 13.87, 97.11, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/aXGNsF14ffhQiMV5Kfrs.png', 1, 1, NULL, '2024-04-23 13:23:06', '2024-04-23 13:23:06'),
(141, 'fx-CG500 PRIZM CAS', 'fx-cg500-prizm-cas', NULL, '<p><div class=\"p-product_detail-hdg-lv1\" style=\"box-sizing: inherit; word-break: keep-all; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; font-weight: 200; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">CAS Graphing Calculators</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">The fx-CG500 PRIZM CAS brings touchscreen technology to the graphing calculator. This CAS calculator\'s extra-large screen allows for more complete and detailed mathematical exploration. Its drag-and-drop functionality enables users to quickly and intuitively pull information from one representation to another. Incorporating CASIO\'s standard Natural Textbook Display, convenient drop-down menus, a handy soft keyboard, and CAS (Computer Algebra System), the fx-CG500 is a powerhouse computational machine.</span><br style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\"><br style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\"><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\nThe fx-CG500 includes a stylus, stylus compartment, and a slide-on protective hard cover.</span><br style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\"><br style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\"></p>', 158.99, 19.87, 139.12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/RPOAorg1WpcxMjTFFqD4.png', 1, 1, NULL, '2024-04-23 13:26:09', '2024-04-23 13:26:09'),
(142, 'GMAS110VW-6A', 'gmas110vw-6a', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>ANALOG-DIGITAL</u></span>&nbsp;WOMEN</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Travel uncharted territory with a watch that delivers you to near-future virtual worlds.\r\n\r\nTranslucent materials transport this watch into the realm of science fiction. The multilayered arrangement of finely detailed components gives striking depth and dimension to the dial, which is accented with a vapor deposition finish on the Y-shaped beam and dial ring for a sophisticated design that is out of this world. \r\n\r\nFrom the ever-popular 110 line, the slim and compact GMAS110 offers a more comfortable and refined fit on slimmer wrists.</span><br></p>', 150.00, 18.75, 131.25, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/27fu0bmiqZPJghO5Wk05.png', 1, 1, NULL, '2024-04-23 13:30:24', '2024-04-23 13:30:24'),
(143, 'GBDH2000-2', 'gbdh2000-2', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>G-SHOCK MOVE</u></span>&nbsp;GBD-H2000 SERIES</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Push it even further with the G-SQUAD GBD-H2000  a selection of G-SHOCK multi-sport watches with heart rate monitor and GPS.\r\n\r\nThese watches come packed with functions for tracking all kinds of workouts. Measure your heart rate with the optical sensor; use the accelerometer to count steps; and take swimming sessions up a notch with a gyroscope that detects strokes and turns. Not only that, sensors that detect orientation, altitude/atmospheric pressure, and temperature help you navigate through whatever you do. \r\n\r\nYou can even tap into the Polar smartwatch library to analyze workouts and post-sleep recovery. Whether running, cycling, or swimming, these watches are essential gear, fully equipped for any and every sport you love. \r\n\r\nReal fitness and health should include environmental considerations. Thats why weve made the band from corn-based biomass plastics. Produced from renewable organic materials, biomass plastics are high-molecular, chemically or biologically synthesized materials that help reduce environmental impact and facilitate the shift to a circular economy.\r\n\r\nCharge with either USB or solar, and youll stay on your game.</span><br></p>', 399.00, 49.88, 349.12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/4cP8QcFTSm6HhrVKCDDx.png', 1, 1, NULL, '2024-04-23 13:33:05', '2024-04-23 13:33:05'),
(144, 'GBD200SM-1A5', 'gbd200sm-1a5', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>G-SHOCK MOVE</u></span>&nbsp;GBD-200 SERIES</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Bring a burst of vitality to your workouts with one of the new brightly colored sporty G-SHOCK Move watches.\r\n\r\nBeneath the gray translucent bezel, the digital GBD200SM-1A5 incorporates splashes of vibrant orange to take your fitness style to the next level.</span><br></p>', 150.00, 18.75, 131.25, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/VlVnd4DV9XaT0wVQt6Fw.png', 1, 1, NULL, '2024-04-23 13:35:20', '2024-04-23 13:35:20'),
(145, 'GBDH1000-1', 'gbdh1000-1', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>G-SHOCK MOVE</u></span>&nbsp;GBD-H1000 SERIES</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">This Outlet store product may not have original packaging or may be missing a manual. The product itself is in new condition.\r\nThis model based on the GBDH1000 series from G-SHOCK MOVE, the G-SHOCK sports lineup, comes equipped with heart rate monitor and GPS functions, uses a vivid translucent resin based on black and is finished in a color scheme that makes activities more enjoyable. \r\nIt is equipped with functions that are useful for working out, including an optical heart rate sensor, a step-count accelerometer, and sensors that detect orientation, altitude/atmospheric pressure, and temperature. The GPS function can also measure running distance, speed, pace, etc. It also supports the measurement of VO2 max, which measures cardiorespiratory fitness, and can be used as an index for improving endurance when running, etc. \r\nAdditionally, a dedicated app allows wearers to check their fitness levels and training progress, and automatically create training plans. Uses Firstbeat\'s library, for data analysis of VO2 max, etc., due to its good reputation in sports science, Supported by a more accurate algorithm. \r\nThe exterior features a curved back cover to reduce discomfort to the back of the hand, a soft urethane band with excellent fit, bi-color molded buttons for superior operability, and a high-definition MIP LCD for great visibility. We sought to enhance practicality by also supporting both USB and solar charging.</span><br></p>', 239.00, 29.88, 209.12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/1HspkpntcpQKmqD0gjAr.png', 1, 1, NULL, '2024-04-23 13:40:03', '2024-04-23 13:40:03'),
(146, 'DWH5600-7', 'dwh5600-7', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>G-SHOCK MOVE</u></span>&nbsp;5600 SERIES</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Take control of your workouts and add flair to your everyday with the DWH5600 from the tough, sports-oriented MOVE line of G-SHOCK watches.\r\n\r\nThese multi-sport watches come packed with functions for tracking all kinds of workouts. Measure your heart rate with the optical sensor and use the accelerometer to count steps. You can tap into the Polar smartwatch library to analyze workouts, track post-sleep recovery, and support breathing exercises  even use the oximeter to measure blood oxygen levels.\r\n\r\nAuthentic fitness and health go along with caring about the environment, too. Thats why weve</span><br></p>', 299.00, 37.38, 261.62, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/xswU5PJWICIgvcRwxOXs.png', 1, 1, NULL, '2024-04-23 13:43:33', '2024-04-23 13:43:33'),
(147, 'GW9500-1A4', 'gw9500-1a4', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>MASTER OF G - LAND</u></span>&nbsp;MUDMAN</div>', '<p><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Unleash bold style and unmatched functionality with the black and orange G-SHOCK Master of G GW-9500-1A4. This distinctive color combination symbolizes the fusion of power and elegance. It\'s an embodiment of the prestigious line of timepieces crafted for those braving the most demanding environments. Known as the </span><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">MUDMAN</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\"> for its top-notch mud-resistant construction, this watch stands as a testament to Casio\'s commitment to excellence in design.\r\n\r\nProminently featuring an easily accessible front button, along with three side-mounted sensor buttons, this design ensures rapid drainage of mud and water. The protective shield, formed by its stainless steel components in contrasting black and orange, keeps the watch safe from potential hazards. Precision engineering ensures that even the button shafts come equipped with gasket fittings, offering a stalwart defense against external contaminants.\r\n\r\nIts vibrant dual-layer LCD, accentuated by the bold black and orange theme, merges perfectly with the Triple Sensor. This allows adventurers to access crucial data such as altitude, direction, temperature, and barometric pressure, all on their wrist. Coupled with the thin module and innovative Carbon Core Guard structure, wearers benefit from a feature-rich yet compact watch that\'s as stylish as it is functional.</span><br></p>', 380.00, 47.50, 332.50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/p17xrfyp9oyDLMI0KkoG.png', 1, 1, NULL, '2024-04-23 13:47:30', '2024-04-23 13:47:30'),
(148, 'GW9500-3', 'gw9500-3', NULL, '<div class=\"p-product_detail-subttl\" style=\"box-sizing: inherit; margin-bottom: 3px; font-size: 18px; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif;\"><span style=\"box-sizing: inherit;\"><u>MASTER OF G - LAND</u></span>&nbsp;MUDMAN</div>', '<p><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Dark Green G-SHOCK MUDMAN: Where Precision Meets Power</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\n\r\nDive deep into the realm of unparalleled durability with the G-SHOCK Master of G MUDMAN in a captivating dark green with intricate black details. This color combination doesn\'t just make a statement; it\'s a testament to the wearer\'s love for elegance intertwined with ruggedness.\r\n\r\n</span><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Triple-Sensor Design for the Avid Explorer</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\nDesigned for professionals who venture into the most challenging environments, this watch stands out with its powerful triple-sensor capabilities. The MUDMAN\'s hallmark is its uncompromising mud-resist construction, ensuring that even the most grueling terrains won\'t compromise its functionality.\r\n\r\n</span><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Functional Excellence Down to the Buttons</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\nBe it the large, user-friendly front button or the three direct sensor buttons, each has been meticulously crafted to drain off mud and water swiftly. Cylinder-shaped stainless steel components protect these buttons, while gasket fittings shield the button shafts from mud and dust, preparing you for any adventure.\r\n\r\n</span><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Innovation on Display: Dual-Layer LCD</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\nThe MUDMAN doesn\'t just tell the time; it speaks to the adventurer in you. With a dual-layer LCD, access vital data like altitude, temperature, and barometric pressure right from your wrist. The innovative Carbon Core Guard structure, paired with a thin module design, encapsulates these functionalities in a slim and compact form, promising a comfortable fit.\r\n\r\n</span><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">More than Just a Watch: A Navigator on Your Wrist</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\nThe digital compass, enhanced by the dual-layer LCD, is your reliable partner in uncharted territories. It displays vivid compass graphics on the top, while time and other essential readings reside below. With models like GW-9500-3 and GW-9500-1A4 boasting a negative dual-layer LCD, your watch becomes an emblem of state-of-the-art tech.\r\n\r\n</span><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">Powered by the Sun, Ready for the Night</span><span style=\"color: rgb(0, 0, 0); font-family: din-2014, &quot;Noto Sans JP&quot;, &quot; ProN&quot;, &quot;Hiragino Kaku Gothic ProN&quot;, Meiryo, , sans-serif; font-size: 14px; white-space-collapse: break-spaces;\">\r\nTaking innovation a step further, the MUDMAN comes with radio-controlled solar power, ensuring precision in timekeeping while harnessing light\'s power. The Super Illuminator feature guarantees that even in the darkest corners, your timepiece will shine bright.</span><br></p>', 380.00, 47.50, 332.50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/backend/files/Y47x3Cq2oYxiGIkZhzlE.png', 1, 1, NULL, '2024-04-23 13:50:25', '2024-04-23 13:50:25'),
