ne; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(22, 22, 22); font-weight: 700; line-height: inherit; font-stretch: normal; overflow-wrap: break-word; word-break: break-word; font-size: inherit; letter-spacing: inherit;\">Enhanced Android Compatibility</h3><ul style=\"margin-bottom: 1em; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; letter-spacing: inherit;\"><li style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><b>Google Fast Pair</b>&nbsp;- connect quickly with a single tap and automatically pair to all Android or Chrome devices registered to your Gmail account<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>8</span></li><li style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><b>Audio Switch</b>&nbsp;- seamlessly transition audio between your Android, Chromebook, and other compatible devices<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>9</span></li><li style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\"><b>Find My Device</b>&nbsp;- easily locate your lost headphones on a map with Google Find My Device<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>10</span></li></ul><p style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">For additional features, download the&nbsp;<a href=\"https://www.beatsbydre.com/mobile-apps\" style=\"color: inherit; text-decoration-line: underline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; transition: color 0.35s ease-out 0s;\">Beats app</a>&nbsp;to unlock access to product customization, software updates, and new features to get the most out of your headphones.</p></div></div><div style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px none; margin-bottom: 32px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; display: flex; width: 1306px; color: rgb(22, 22, 22); font-family: neuzeit-grotesk, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 20px; letter-spacing: -0.2px; order: 3;\"><h3 class=\"pdp-detail-title\" style=\"margin-right: 1.4rem; margin-bottom: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; color: rgb(22, 22, 22); font-weight: 700; line-height: inherit; font-stretch: normal; overflow-wrap: break-word; word-break: break-word; font-size: inherit; flex: 1 1 20%; letter-spacing: inherit;\">Power</h3><div style=\"background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; flex: 1 0 70%;\"><ul style=\"margin-bottom: 0px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; letter-spacing: inherit;\"><li style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">Up to 40 hours of listening time (ANC off)<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>1</span>&nbsp;on a single charge</li><li style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px;\">Up to 24 hours of listening time with ANC or Transparency mode enabled<span style=\"font-size: 0.675em; vertical-align: baseline; top: -0.4em; position: relative;\"><span class=\"visuallyhidden\" style=\"background: 0px 0px; border: 0px; hyphens: manual; font-feature-settings: &quot;kern&quot;; border-radius: 0px; position: absolute; clip: rect(0px, 0px, 0px, 0px); clip-path: inset(0px 0px 99.9% 99.9%); overflow: hidden; height: 1px; width: 1px; text-wrap: nowrap;\">footnote</span>1</span></li><li style=\"margin-bottom: 10px; background: 0px 0px; border: 0px none; hyph